INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(1, 'hoduc17', , 'Sc! 71% fan Man Utd mun tin v 40 triu bng ra i', 'ng tin v tng nh rt cht lng li ang l vn  ca Man Utd.', 'Hng tin v tng nh rt cht lng li ang l vn  ca Man Utd.\r\n\r\nC th ni, ngoi Paul Pogba, khng mt tin v no ca Man Utd tht s xut sc.  trn u vi Man City, khi Pogba vng mt, nhng im yu ca Qu   l r. Tn binh t gi Fred thm ch cn khng c ra sn. Ander Herrera v c bit l Nemanja Matic khi c tin dng  phi chu nhiu ch trch.\r\n\r\nSc! 71% fan Man Utd mun tin v 40 triu bng ra i 0- Matic - Bng \r\n Matic chi kh t trong ma ny.\r\nTheo The Times, cc cu th Man Utd  t cu hi vi HLV Jose Mourinho khi Ngi c bit lin tc tin dng Matic, d tin v ny ang c phong  km ci.\r\n\r\nSau mt ma bng n tng  Old Trafford, Matic  sa st thy r khi phi cy i qu nhiu. Ngi sao ngi Serbia t ra chm chp, thiu sc sng v  khng lm tt nhim v nh chn t xa cng nh phn phi bng ca mnh.\r\n\r\nTrong mt cuc thm d c t footballfancast a ra, c n 71% fan Qu  ng tnh nu Man Utd bn Matic ngay t k chuyn nhng ma ng ny.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(2, 'dung29', , 'L do Mourinho l \'ci gai\' trong mt lng tc cu: Ti nng hn ngi, tnh cch khc ngi', 'Mourinho ti nay l HLV b khng t ngi trong gii tc cu t ra ghen ght.', '5. Tranh lun gay gt vi truyn thng\r\n\r\nMourinho khng phi kiu ngi hay lm b trc ng knh phng vin. Ni ng hn, \'\'Ngi c bit\'\' chng n nang hay king d bt c iu g. Chin lc gia ngi B o Nha thng t ra cu knh v sn sng p tr d lun mt cch gay gt. Cng bng m ni, y khng phi l tnh cch xu ca cu HLV Chelsea. Song, vic ng ko cc hc tr ln i nh  ch trch cng khai khin ngi hm m kh lng chp nhn.\r\n\r\n5 l do khin Mourinho tr thnh ci gai ca lng tc cu: - Bng \r\nMourinho thch tranh ci vi truyn thng v ko theo c cc hc tr.\r\nTt c u nm trong gii hn v Mourinho dng nh khng hiu c iu . T Real, Chelsea v gi l Manchester United, cc ngi sao ln lt tr thnh tm bia  n cho nhng sai lm ca nh cm qun 55 tui. Eden Hazard, Paul Pogba v thm ch c Cristiano Ronaldo u phi i mt vi cn thnh n t ng trc gii truyn thng.\r\n\r\n4. Li  tiu cc\r\n\r\nNu l c ng vin lng tc cu, mi ngi u s nghe n thut ng \"dng xe but\". V Mourinho chnh l HLV hiu v p dng li  ny thnh cng hn c. Chin thut phng th ca chin lc gia ngi B o Nha gip ng gy dng thng hiu v ginh nhng danh hiu danh gi  Chelsea, Inter, Real Madrid v MU.\r\n\r\nTh nhng, trong gii bng , mt chin thut cng c hn s dng. V hin ti, chng cn bao nhiu ngi mn m, hng th vi cch thi u ny.  Manchester United, li  tiu cc ca \"Ngi c bit\" chng nhng khin cc siu sao khng pht huy ht ti nng m cn bin CLB tr thnh i bng lc hu, nh mt bn sc. 10 ngi ng sau 1 tri bng, d th no i na,  cng khng phi th bng  m khn gi mun xem.\r\n\r\n3. Chuyn nhng t hi\r\n\r\nKhi khng c c nhng g mong mun, Mourinho tr thnh ngi n ng gt gng v k lm lon. Nh k chuyn nhng h 2018, Ban lnh o MU cng quyt t chi cc mc tiu ca \'\'Ngi c bit\". Th l, cu HLV Real thng thng ma mai thng tng CLB.\r\n\r\nNhng tht s, \"Qu \" c l do  quyt nh nh vy. Cha y 3 nm  Old Trafford, Mou chi c na t euro  mua sm cu th. Nhng ngi sao nh Victor Lindelof v Eric Bailly u rt bnh thng. Ngay c bom tn Pogba, Lukaku cng nh mt chnh mnh. R rng, nh cm qun 55 tui khng bit ngi sao no ph hp vi i nh cng nh tm cch  gip  h.\r\n\r\n2. Ci ti ln hn CLB\r\n\r\nKhi gp phi rc ri hay phm phi sai lm, thay v gi im lng, Mourinho cng mnh m i u vi truyn thng. Tic l, \"Ngi c bit\" l dng cch tiu cc  gii quyt. ng khng nhn li, khng bit u ng sai m ch  li v tt c  bo v bn thn.\r\n\r\n5 l do khin Mourinho tr thnh ci gai ca lng tc cu: - Bng \r\n Ci ti ca Mou qu ln.\r\nCi ti ca Mou qu ln, ng lun mun c ca tng, khen ngi.  l l do ti sao cu thuyn trng Inter khoe nhng thnh tch qu kh. V ri khng nhng khng cng cc hc tr, i nh ng cam cng kh, ng cn mng chi hc tr v ch trch CLB.\r\n\r\n1. Thnh cng rc r\r\n\r\nCui cng, phi cng nhn mt iu rng, Mourinho thuc top nhng HLV thnh cng bc nht lng tc cu. Chin lc gia ngi B o Nha cng Porto, Inter, Chelsea v c Real nhiu ln ginh tt thy cc danh hiu cao qu. Cng thm c tnh mnh, thng thn, ng cha bao gi khim tn v ti nng bn thn. V vy, mi ngi ghen t v ght lun nhng g m \"Ngi c bit\" t c.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(4, 'dung29', , 'Tht may v Arsenal khng bn ti\'', 'Alexandre Lacazette c nhng tri lng v mi lng duyn vi Arsenal.', 'Sau rt nhiu n on, Arsenal cng em Alexandre Lacazette v thnh cng t Lyon. Trc  tng c tin rng tin o ngi Php lin tc t chi \"Pho th\", v s tht ng l nh vy.\r\n\r\n - Bng \r\n Lacazette ang l cu th chi hiu qu nht ti Arsenal.\r\n\"Trc khi chnh thc gia nhp Arsenal, ma h 2016 ti  m phn vi Arsenal. Tuy nhin,  khng phi l thi im tt  sang Anh, v khi h tr li tm ti, ti  ngh h thc s cn mnh, mi chuyn sau  din ra rt sun s.\"\r\n\r\n\"Ti hnh phc v c chi ti gii u ny (Premier League) vi nhng ng i mi. Tht mng l ma h va qua Arsenal  khng bn ti i, h ni rt vui v c ti xut hin trong i bng.\"\r\n\r\nQuyt nh gi Lacazette n lc ny ca Unai Emery l hon ton ng n. Cng vi Aubameyang, b i ny tr thnh cp song st li hi trn hng cng Arsenal. Theo thng k t WhoScored, khng cu th no ti Emirates ang thi u tt hn tin o ngi Php.\r\n\r\nAnh lun bit ta sng trong nhng thi khc quan trng, tiu biu nh bn g ha qu gi vo li Liverpool  gi li 1 im cho Arsenal.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(5, 'hoduc17', , 'V v Coutinho, n lc ny Barca vn cn l \"con n\"', 'Philippe Coutinho  l ngi ca x Catalan t hi thng Ging, th nhng cho n lc ny Barca vn cn n Liverpool mt khon tin khng nh.', 'Nh  bit, Barcelona  phi chi tr s tin khng l 106 triu bng nhm a Philippe Coutinho v Camp Nou. Khng nhng th, g khng l x Catalan cn phi chp nhn khng c mua thm bt k cu th no ca Liverpool trong vng 2 nm ti (ht hiu lc vo nm 2021). R rng vi ng thi ny, i din nc Anh  rt ra c mt bi hc xng mu sau khi lin tc b \"rt rut\".\r\n\r\nTh nhng  cha phi l ton b ca cu chuyn. Theo , lc ny nh KV La Liga vn cn ang n The Kops s tin 36 triu bng. Tuy nhin, Liverpool  chp nhn cho pha Barca tin hnh tr gp trong thi gian Coutinho thi u ti Ty Ban Nha. C mi khi Coutinho chm mc 25 ln ra sn, Blaugrana s mt cho The Kops s tin 4,4 triu bng.\r\n\r\nHow much Barcelona still owe Liverpool for Philippe Coutinho revealed - Bng \r\nLc ny Barca vn cha tr ht n cho Liverpool.\r\nNgoi ra, c mi nm Barca c tham d Champions League, h cng s mt khon tin tng t l 4,4 triu bng. V s tin ny s nhn i nu ng ln x Catalan v ch. Lc ny tin v ngi Brazil c 29 ln ra sn, iu ny ng ngha vi vic L on   nhn c s tin t ln chi tr u tin.\r\n\r\nQuay tr li vi iu khon trn, nh vy l Jurgen Klopp  c th tm thi \"k cao gi m ng\" trc s dm ng ca Barca, du vy mt i bng khc vn ang lo ngay ngy v CLB o xc  lam,  l Tottenham Hotspur khi mi y ch thn Lionel Messi  ln ting yu cu thng tng Camp Nou chiu m tr ct ca Lilywhites l Christian Eriksen.', 'Anh TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(6, 'dung29', , 'Bn Dembele lc ny, Barca s \"mt trng\" \"Pellegrini\"', 'Nu  Ousmane Dembele ri Camp Nou lc ny, Barca s phi lp tc tr nt s tin 26 triu bng cho Borussia Dortmund.', 'Mi y, t Die Welt  tit l Barcelona s phi lp tc hon thnh chi tr s tin 131 triu bng cho Borussia Dortmund nu nh h  Ousmane Dembele ra i trc thi hn kt thc hp ng vo nm 2022. Theo , hi h nm ngoi i din nc c mi ch nhn v s tin 96 triu bng, cn s tin ph thu 35 triu bng vn ang c Barcelona tr trong qu trnh Dembele chi bng ti Catalan.\r\n\r\nLc ny, CLB o sc  lam  mt cho Dortmund 9 triu bng, trong  c mt na v Dembele  t ct mc 25 ln ra sn, na cn li l bi Barca  ginh c tm v tham d Champions League. R rng, Barcelona khng s hu tim lc ti chnh qu mnh nh Manchester United hay Paris Saint Germains, bi th vic c tr gp s tin ph thu - cn li 26 triu bng cha thanh ton, tc tng ng vi s tin ph v hp ng ca Lorenzo Pellegrini - l mt li ch tng i ln m i ch sn Camp Nou nhn c t thng v Dembele.\r\n\r\nBarcelona \'face paying full 131m fee for Ousmane Dembele if they sell the winger before the end of his contract\' - Bng \r\nBarca s phi lp tc thanh ton s tin 26 triu bng cho Dortmund nu bn Dembele lc ny.\r\nV pha tin o 21 tui, hin ti anh ang tri qua qung thi gian kh en ti trong s nghip. Chng nhng vng mt trong chin thng ca T Php trc Uruguay rng sng hm nay, anh cn ang \"khng hnh phc\" ti Camp Nou. Truyn thng Catalan thi gian qua thm ch cn a tin Dembele nu khng nhanh chng ci thin c th s b y i. Tuy nhin nu vin cnh ny xy ra, y s l mt c sc ti chnh ln vi nh KV La Liga, nht l khi v thng v mang tn Philippe Coutinho, h vn ang l \"con n\" ca The Kops.\r\n\r\nC Arsenal ln Liverpool u mun chiu m Dembele, th nhng khng ai trong s hai i din ca x s sng m sn sng b ra s tin m Barca  phi chi ra  c c anh.', 'TBN Duc', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(7, 'dung29', , 'Xong: PSG ci u thng v Rabiot', 'Mi y, truyn thng nc Php a tin v quyt nh ca PSG v tng lai Rabiot.', 'Sau thi gian c v im ng, ci tn Rabiot tip tc no lon lng tc cu. Lin tip nhng ngy qua, truyn thng Ty Ban Nha khng ngng cp nht tin tc lin quan n tng lai tuyn th ngi Php  PSG. Theo t Sport.es, cuc chin dai dng gia c 3 ang i n hi kt. C Barca v PSG u gp rt hon tt mi th tc  sm cht thng v trn.\r\n\r\nXong: PSG ci u thng v Rabiot - Bng \r\n PSG mun bn Rabiot.\r\nTrong khi , v pha Mundo Deportivo, t bo tit l ngi sao 23 tui  thng bo vi Ban lnh o \"Blaugrana\" anh ng  chuyn n Camp Nou. Thi im l vo ngy 1/7/2019 khi tin v s 25 kt thc hp ng vi PSG v ra i theo dng t do.\r\n\r\nMi y, bo ch nc Php tip tc cp nht tin tc t sn \"Cng vin cc Hong t\". C th, t Le Parisien cho bit trc tnh th kh khn v s kin quyt ca Rabiot, Ban lnh o i din Paris khng cn nhiu c hi  thuyt phc anh. Theo , Gim c th thao CLB, Antero Henrique s sm ln k hoch bn tin v s 25 ngay trong k chuyn nhng ma ng  thu v 1 khon tin va phi.\r\n\r\niu ny cng ng ngha, sau thi gian c gng cho ko, ng kim v ch Ligue 1 cng nh chp nhn u hng Rabiot. Theo Mundo Deportivo, hng ng ca PSG va mun kim tin va mun gy kh d cho Barca.  i bng s m ca cho nhiu ngi tham gia v ch chp nhn bn cho CLB no tr s tin cao, hp l.', 'TBN Phap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(8, 'hoduc17', , ' li Chelsea hay v vi Real, sao 24 tui  c cu tr li', 'Ngi sao hin ang khoc o The Blues chnh thc ln ting v tng lai ca mnh.', 'Mateo Kovacic gia nhp Chelsea h qua, theo bn hp ng cho mn c thi hn mt nm t Real Madrid. D vn phi vng vo cuc cnh tranh v tr vi Ruben Loftus-Cheek hay Ross Barkley cho sut th 3 trong hng tuyn gia 3 ngi cng N\'Golo Kante v Jorginho, nhng nhn chung, anh vn c nhiu thi gian gp mt hn thi  Santiago Bernabeu.\r\n\r\nTrong bi phng vn mi y vi Marca, Kovacic  th l  mun tng lai ca mnh. Theo , tin v 24 tui mong mun tip tc c  li Ty London sau khi kt thc ma gii hin ti.\r\n\r\nKovacic mun  li Chelsea - Bng \r\n Kovacic mun gn b lu di vi The Blues.\r\n\"Ti mun c hnh phc v ti Chelsea, ti ang cm thy th.\" Kovacic chia s. \"Ti ch mun c ra sn trong cc trn u, nhn lnh trch nhim trong i bng.  l nhng g ti tm thy  Chelsea lc ny.\"\r\n\r\n\"y khng phi l lc bn v nhng chuyn khc ngoi chi bng v tn hng tng pht trn sn. Ti khng mun ngh v nhng g s xy ra. Ti ch mun c thi u hng tun.\" \r\n\r\nRng sng mai, Kovacic nhiu kh nng s gp mt trong i hnh xut pht ca Croatia i u tuyn Anh, trong trn u quyt nh v i tip  nhm A UEFA Nations League.', 'Anh TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(9, 'dung29', , 'ng i tin Ronaldo  sc \'cy\' ti 40 tui', 'Trung v Giorgio Chiellini tin rng vi t cht ca mnh, Cristiano Ronaldo hon ton c th tip tc thi u  cc gii nh cao n nm 2020.', 'C th Giorgio Chiellini, ngi nm nay cng  34 tui, chia s rng: \"Vng, chng ti hon ton c  kh nng  thi u n nm 40 tui, mc d ti khng rng mnh s chi lu n vy.\"\r\n\r\nng i tin Ronaldo  sc \'cy\' ti 40 tui  - Bng \r\n Liu Ronaldo c tip tc thi u n nm 40 tui?\r\n\"iu ny khng phi ch v Ronaldo lun l ngi n sn tp u tin, m chnh cch m anh y tp luyn mi l iu to nn s khc bit. Anh y lun thc y bn thn.\"\r\n\r\n\"Anh y l mt ngi rt thng minh. Anh y ti mt gii u v quc gia rt khc bit, tuy nhin  rt nhanh chng n lc tm kim nhng im ni bt  y.\"\r\n\r\nThc t theo cc bo co kim tra sc khe m Juventus c c hi u ma gii nm nay, kh nng Ronaldo tip tc chi bng thm nhiu nm na l iu hon ton c th xy ra khi th trng hin ti ca CR7 chng khc no mt chng trai ch  tui i mi.\r\n\r\nBn thn Ronaldo trong ma gii nm nay cng  cho thy rng anh vn cha h gi, khi  ghi c ti 8 bn v 5 pha kin to trong 12 ln ra sn trong mu o Juventus.', 'Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(10, 'hoduc17', , 'Cha ca David Ospina khng nh Napoli mun gi anh li', 'Mn trnh din ca th mn ngi Colombia  thuyt phc BL Napoli gi li anh.', 'Ma h va qua, David Ospina chuyn t Arsenal sang Napoli theo dng cho mn vi thi hn mt nm. Trong bn hp ng c chi tit rng nu th thnh ny ra sn t 30 trn tr ln cho i ch sn San Paolo, Napoli s c quyn mua t anh, v din bin gn y cho thy h thc s mun lm iu .\r\n\r\n - Bng \r\n David Ospina chi rt n nh trong mu o Napoli.\r\nCha ca David Ospina, ng Hernan cho bit: \"Vng, ti  nghe rt nhiu v chuyn  (Napoli mun gia hn vi Ospina) t gii truyn thng.\"\r\n\r\n\"Napoli mun gi Ospina bt chp con s 30 trn u c din ra hay khng. N hin ang hnh phc, ang chi rt tt cng ton i v hin  trong CLB hng u ti Italia.\"\r\n\r\n\"Ospina thng gi cho ti trc mi trn u. N rt chuyn nghip v tn ty vi cng vic ca mnh. N hy sinh bn thn ca mnh v tp th, v cn l cu b tuyt vi lun cng hin ht mnh cho Naples.\"\r\n\r\nTnh n thi im ny, th mn ngi Costa Rica  ra sn tng 11 trn cho i ch sn San Paolo. V vi nhng g ang th hin, vic Napoli mun gia hn vi Ospina cng khng phi iu g qu ngc nhin.', 'Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(11, 'hoduc17', , 'Gc PSG: S bt lc ca ni tin Qatar', ' Tin ca cc ng ch Qatar  gip cho PSG gii quyt c rt nhiu vn , nhng lc ny th c c ni tin th cng chng gip c cc nh KV nc Php.', 'Kt thc lot trn giao hu quc t vo m qua, PSG  lin tc nhn 2 hung tin tri ging t cc trn u gia Brazil - Cameroon v Php - Uruguay. C th t trc khi ting ci chung cuc ca trng ti vang ln, b i ngi sao ch lc trn hng cng ca PSG l Neymar v Mbappe u  gc ng xung sn trong au n.\r\n\r\nGc PSG: Ci tt cho ni tin t Qatar - Bng \r\n PSG  nhn lin tip 2 hung tin trong lot trn giao hu m qua.\r\nC Neymar ln Mbappe u s c tin hnh kim tra trong 24 gi na trc khi kt qu chn on cui cng v chn thng c cng b. Trong trng hp xu nht c th xy ra, gii quan st lo s rng b i ny c th s khng kp tr li trong trn u cc k quan trng vi Liverpool din ra ti Cng Vin Cc Hong T vo tun sau.\r\n\r\n l trn u mang tnh cht \'sng cn\' ca PSG ti Champions League, v ch cn tht bi th coi nh cnh ca vt qua vng bng ca cc nh ng kim v ch nc Php s khp li. C th vo thi im hin ti, PSG ch ang xp th 3 vi ch 5 im. Trong khi  Liverpool v Napoli u ang c cng 6 im. Nu thua, PSG s km Liverpool ti 4 im v kh nng cao y cng s l khong cch vi Napoli (i bng ch phi i u vi i th cht bng u l FK Crvena Zvezda). Khi  1 trn u cn li ca vng bng r rng khng   PSG ginh quyn i tip.\r\n\r\nHy nh rng vi cc ng ch Qatar, Champions League mi chnh l u trng m h mun chnh phc nht, ch khng phi l vic bo v ngi vng ti Ligue 1.  cng chnh l l do h  chp nhn b ra gn 300 triu euro ch  chiu m Neymar v Mbappe vo u ma gii nm ngoi.\r\n\r\nGc PSG: Ci tt cho ni tin t Qatar - Bng \r\n Nu khng th thng c Liverpool, kh nng PSG b loi khi Champions League l rt ln.\r\nCng v kht khao c chm tay vo chic cp bc danh gi ti Champions League, PSG hin cng ang b UEFA iu tra gt gao v tnh trng ti chnh ca i bng. C th c quan quyn lc nht chu u nghi ng PSG  c nhng hnh vi vi phm lut cng bng ti chnh, v nu tm ra bng chng th i ch sn Cng Vin Cc Hong T hon ton c th b cm chuyn nhng, thm ch l cm thi u ti Champions League.\r\n\r\nNu vin cnh ny tht s xy ra, gn nh s c mt cuc tho chy rt ln s din ra. n lc ny c th ni tin ca PSG cng bt lc trong vic gi chn c nhng ngi sao nh Neymar, Mbappe,...  li i bng. Lc  r rng nhng k hoch m h  vch ra cch y 2 nm s chnh thc ph sn.', 'C1 Phap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(12, 'dung29', , '5 ngi sao tr xut sc nht th gii hin ti:  hiu v sao Dortmund tr li n tng', 'Lng tc cu ang chng kin s ni ln ca hng lot ngi sao tr ti nng.', '5. Kai Havertz (Bayer Leverkusen)\r\n\r\nNm 2009, Kai Havertz tng v nh  cuc bu chn cu th U17 hay nht nc c. 1 nm sau, ngi sao s 29 gia nhp i tr Bayer Leverkusen khi mi 11 tui. Vi vic ra mt i 1 CLB vo ngy 15/10/2016, tuyn th sinh nm 1999 tr thnh cu th tr nht khoc o i nh ti Bundesliga.\r\n\r\nThe 5 best teenagers in world football currently - Bng \r\nKai Havertz thi u ngy cng tin b.\r\nCha dng li  , anh cn lp thnh tch cu th tr nht nht ghi bn cho Leverkusen  gii u s 1 nc c.  i tuyn quc gia, Havertz tng chi bng  cc i U16, U17 v U19 c. Ngi sao 19 tui  c tng cng 30 trn v ghi c 9 bn.\r\n\r\n ma gii 2017/2018, Havertz c mn trnh din v cng n tng. Th nhng, hin ti, tin v s 29  t a ti nng bn thn ln tm cao mi. Sau 14 trn u trn mi u trng, tuyn th ngi c b ti 6 bn thng v 4 kin to. Quan trng hn, anh ang chi tt  v tr s \'\'10\'\' v tr thnh tri tim ni tuyn gia CLB. Trong tng lai, ngi sao 19 tui c th tr thnh ngi k tha Ballack v Ozil  tuyn quc gia.\r\n\r\n4. Dan-Axel-Zagadou (Borussia Dortmund)\r\n\r\nDi thi HLV Lucien Favre, Zagadou thi u vi b mt v cng xut sc. Tuyn th ngi Php hin l bc tng chc chn bc nht Bundesliga d ch mi 19 tui. Cc thng k ch ra rng, ngi sao s 2 khng ngng tin b tng ngy. Ti nay, trung v sinh nm 1999 t thnh tch gi sch li i nh trung bnh 6 ln 1 trn, 2.6 ln thu hi bng thnh cng.\r\n\r\nCha k, kh nng kim sot bng ca Zagadou cng rt n tng, 74.7%/1 trn. Trong khi , t l chuyn bng chnh xc hn 87.5%. Quan trng hn, ngi sao ngi Php gp cng ln trong kt qu tuyt vi ca Dortmund ti Bundesliga v Champions League.\r\n\r\n3. Jadon Sancho (Borussia Dortmund)\r\n\r\nLa chn Bundesliga thay v Premier League, Sancho ang chng t vi th gii quyt nh ca bn thn hon ton ng n. Di s dn dt ca HLV Lucien Favre, ngi sao ngi Anh ch c s dng nh qun bi d bo. Song, tin v s 7 khng ngng ta sng.\r\n\r\nThe 5 best teenagers in world football currently - Bng \r\n Sancho thi u n nh d l con bi d b.\r\nHin ti, Sancho  b ti 4 bn thng cng 6 ng chuyn thnh bn. Cu th 18 tui cn nm trong top 5 chn kin o hng u chu u tnh ti nay. Phong  n tng ca ti nng tr ngi Anh gip Dortmund ang dn u  Bundesliga.\r\n\r\n2. Matthijs De Ligt (Ajax)\r\n\r\nDe Ligt l cu th trng thnh t l o to ca Ajax. Tuyn th ngi H Lan nhanh chng  li du n  i tr CLB. Hu v s 3 ra mt i 1 nm 2016 v ngy cng trng thnh, tin b trong mu o i nh.\r\n\r\nKhng nhng vy,  tui 18, De Ligt  c chi trn u tin trong mu o i tuyn quc gia. y l vinh hnh vi ngi sao sinh nm 1999 khi tr thnh cu th tr nht tng chi cho T H Lan k t sau Mauk Weber nm 1931.\r\n\r\nDe Ligt c chiu cao 1m88, s hu nhng t cht ca mt trung v hng u, c kh nng khng chin tt, chn v tr hon ho v cng rt thng minh trong nhng tnh hung tranh chp. Cu th ngi H Lan thun c hai chn v hon ton c th thi u tt  hng tin v vi kh nng thu hi bng.\r\n\r\n1. Kylian Mbappe (Paris Saint-Germain)\r\n\r\nKhng qu kh hiu khi Mbappe dn u danh sch cc cu th xut sc nht th gii thi im hin ti. Chc v ch World Cup cng mn trnh din tuyt vi ti u trng th gii, ngi sao PSG lm c iu m bao nhiu danh th m c d mi 19 tui.\r\n\r\nThe 5 best teenagers in world football currently - Bng \r\nMbappe vn ang thi u xut sc.\r\nHin ti, tin o s 10 l tr ct quan trng ca ng kim v ch Ligue 1. Sau 12 vng u, tuyn th ngi Php c 11 bn thng v 4 kin to cho i nh  gii quc ni. Cha k, anh cng b ti thm 2 bn  Champions League. Cha k, Mbappe ang dn u danh sch cuc ua \"Chic giy vng chu u\".', 'Phap Duc C1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(13, 'hoduc17', , 't xong tha thun, Ibrahimovic cht ngy tr li Italia', 'Theo La Gazzetta dello Sport, Zlatan Ibrahimovic  t c nhng iu khon c bn trong vic tr li u qun cho AC Milan.', 'Li  ngh m AC Milan dnh cho Ibra tm thi l mt bn hp ng ngn hn trong vng 6 thng. Tuy nhin trong  cng c bao gm nhng iu khon cho php gia hn thm 1 nm da vo nhng thnh tch m tin o ngi Thy in t c trn sn c.\r\n\r\nt xong tha thun, Ibrahimovic cht ngy tr li Italia - Bng \r\n Ibra ang trn ng tr li AC Milan.\r\nTheo La Gazzetta dello Sport, c bn th Ibra v Milan  thng nht xong cc iu khon v nhiu kh nng tin o 37 tui ny s lp tc tr li Italia  hon tt nhng th tc cn li sau khi TTCN chnh thc m ca tr li vo thng Ging 2019.\r\n\r\nVic Ibra tr li ha hn s m ra mt cuc cnh tranh rt d di cho v tr trung phong cm ca Milan trong giai on cn li ca ma gii. Hin Higuain ang l cu th c HLV Gattusso tin tng giao cho mt sut  chnh, nhng phong  m nht thi gian qua ca cu tin o Juventus c th khin anh b nh bt ln bng gh d b bt c lc no.\r\n\r\nTri vi Higuain, Ibra li va tri qua mt nm y thnh cng trong mu o LA Galaxy ti MLS. C th ngay trong ma u tin ti M chi bng, Ibra  c tng cng 22 bn thng cng 10 ng kin to sau 27 ln ra sn, qua  ginh lun gii thng \'tn binh ca nm\'  gii u ny.', 'CN Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(14, 'dung29', , 'Tin nhanh 22/11: M.U mt toi 300 triu; Real git thng v kp 90 triu', 'cp nht thng tin nhanh v nhng s kin mi nht ca lng tc cu.', 'Rafinha quyt tm ng ri Barca. Cha v cng l ngi i din ca Rafinha, ng Mazinho, ni rng cu th ngi Brazil cn phi ri Barca  tm kim c hi ra sn nhiu hn.\r\n\r\nTin nhanh 22/11:  - Bng \r\n Man United st gim nghim trng.\r\n\"Neymar sai lm khi ti PSG\". Cu tin v ca Barca v T Brazil, Edmilson cho rng Neymar  sai lm khi t b Barca  ti PSG. Theo Edmilson, nu quyt nh gn b vi sn Camp Nou, Neymar s c c hi tt hn  tr thnh ngi sao s 1 th gii.\r\n\r\nJuan Mata cha vi gia hn hp ng vi M.U. Theo t ESPN tit l, Juan Mata cha t bt k vo bn hp ng mi vi M.U, bt chp bn hp ng ca anh vi Qu  ch cn thi hn ti h nm 2019.\r\n\r\nArsenal mun chiu m \"hng tha\" Liverpool. Hin ti, ngoi Monreal, Unai Emery ang nm trong tay Sead Kolasinac, Ainsley Maitland-Niles cng Granit Xhaka l nhng ci tn c th thi u  cnh tri. Th nhng theo The Mirror, i bng thnh bc London ang nhm ti Alberto Moreno nhm d phng cho trng hp Monreal ri Emirates.\r\n\r\nMan Utd mt 300 triu bng. Sn giao dch chng khon New York  chng kin s st gim gi tr rt ln ca Man Utd vo ngy 20/11 va qua. Theo , mi c phiu ca Qu   rt gi t 15,58 bng xung ch cn 14,22 bng. y l s st gim nghim trng nht ca Man Utd k t thng 10/2017. Tnh ra, tng gi tr ca Qu   mt hn 300 triu bng.\r\n\r\nReal Madrid 1 lc git 2 thng v cc cht? Real Madrid ang ln k hoch chiu mt cng lc 2 tn binh n t Premier League. Ngun tin t Mirror tit l, Real Madrid sn sng chi 50 triu bng cho Marcus Rashford v 40 triu bng cho Christian Eriksen.', 'Anh CN Phap Duc TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(15, 'dung29', , 'Barcelona: Mun tr li Nou Camp, Neymar phi p ng 2 iu kin', 'Barcelona  a ra 2 iu kin khng h d dng cho Neymar nu mun tr v Nou Camp.', 'Trong nhng ngy va qua, thng tin Neymar s ri Paris Saint-Germain v quay v x Catalunya ang l ch  c bn tn nhiu nht trn cc mt bo.\r\n\r\nD vn ang th hin mt phong  n tng  nc Php vi 13 bn thng cng 6 ng kin to, th nhng, cuc sng ca ngi sao ngi Brazil ang c n on khng my d chu, c bit vi mi quan h \"cm khng lnh, canh chng ngt\" vi trung phong Edinson Cavani.\r\n\r\nDo , t Daily Star  a ra thng tin cho rng Neymar ang suy xt n vic ri sn \"Cng vin cc hong t\"  tr v Nou Camp khoc o Barcelona.\r\n\r\nD vy, theo cp nht mi nht t t Mirror, pha Blaugrana  a ra 2 iu kin khng d p ng i vi Neymar nu anh mun v Catalunya thi u.\r\n\r\nBarcelona: Mun tr li Nou Camp, Neymar phi p ng 2 iu kin - Bng \r\nLiu Neymar c tr v Barcelona? \r\niu kin th nht, ngi sao ngi Brazil phi xin li cc c ng vin Barcelona sau khi la chn ri b i bng  gia nhp \"g nh giu\" Ligue 1, Paris Saint-Germain. \r\n\r\niu kin th hai, Neymar phi chp nhn k mt bn hp ng vi nhng iu khon v thu nhp khng cn hp dn nh lc anh khoc o PSG.\r\n\r\ny chc chn s l hai thch thc khng h d dng cho Neymar nu nh anh mun tr v Barcelona.', 'CN Phap TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(16, 'dung29', , 'Chelsea, Liverpool ch ! Sao 70 triu bng xc nhn thi im chuyn nhng', 'Ngi sao ang chi cho Dortmund, Christian Pulisic  tit l v thi im anh s m phn tng lai vi CLB,', 'Tuyn th quc gia M  c lin kt vi Chelsea v Liverpool trong nhng tun gn y sau khi nhng thng tin t c tuyn b Pulisic mun ri Dortmund. Ma ny, anh  khng ra sn qu nhiu v s xut hin n tng ca sao tr Jadon Sancho.\r\n\r\nGiao ko hin ti gia hai bn vn cn n nm 2020 v cho n nay, Pulisic dng nh khng mun gia hn vi CLB ch qun. By gi, tin o sinh nm 1998 khng nh rng mnh cha c  nh ni v vn  hp ng qu sm.\r\n\r\n\"Ti vn tp trung vo k hoch ti Dortmund. Chng ti ang lm rt tt trong ma gii ny\", Pulisic ni vi NBC Sports. \"Ti s ni chuyn vi CLB v xem xt tng lai ca mnh vo thng Ging\".\r\n\r\nChelsea, Liverpool ch ! Sao 70 triu bng xc nhn thi im chuyn nhng - Bng \r\n Ngi sao ln nht ca tuyn M  tuyn b v thi im mnh xc nh tng lai ti Dortmund.\r\nJurgen Klopp rt yu thch Pulisic v nhiu thng tin cho rng ng mun chia tay vi Fabinho  c ngn sch chiu m cu th  CLB c ca mnh. D vy, ngi sao ngi Brazil mi n trong ma h va qua, v vy mt ng thi vo thng Mt l iu kh xy ra.\r\n\r\nChelsea cng ln k hoch \'cp hng\' ca Liverpool vi s tin ln ti 70 triu bng. ng thi ny xy ra l v h lo s b UEFA cm chuyn nhng trong vng hai nm ti. V Pulisic s mang n cht lng lu di cho The Blues.', 'CN Anh Duc', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(17, 'hoduc17', , 'Son Heung-min ghi bn a Tottenham tr li v tr th 2', 'Ngi sao ngi Hn Quc ng gp 1 pha lp cng trong chin thng 3-0 ca Tottenham trc ch nh Cardiff  vng 21 Premier League din ra sng 2/1', '<p>Sau tht bi g&acirc;y sc 1-3 tr&ecirc;n s&acirc;n nh&agrave; trc t&acirc;n binh Fulham  v&ograve;ng 20,&nbsp;<a href=\"http://www.bongda.com.vn/Tottenham-search/\" target=\"_blank\">Tottenham</a>&nbsp;h&agrave;nh qu&acirc;n n s&acirc;n ca mt CLB mi l&ecirc;n hng kh&aacute;c l&agrave; Cardiff vi mc ti&ecirc;u gi&agrave;nh trn 3 im  &ograve;i li v tr&iacute; th 2 t tay Man City.</p>\r\n\r\n<p>o&agrave;n qu&acirc;n ca HLV Mauricio Pochettino mt 3 ph&uacute;t  c&oacute; b&agrave;n thng u ti&ecirc;n v&agrave;o li Cardiff. ng tt b&oacute;ng ca Kieran Trippier khin hu v ch nh&agrave; l&uacute;ng t&uacute;ng, Harry Kane chp thi c dt im  c ly gn h gc th m&ocirc;n Neil Etheridge. T&iacute;nh c&nbsp;b&agrave;n thng v&agrave;o li Cardiff, Harry Kane &atilde; chc thng li to&agrave;n b 28 i th anh tng gp ti Premier League.</p>\r\n\r\n<p><img alt=\"Son Heung-min ghi bn a Tottenham tr li v tr th 2 - Bng \" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/02/so-01-0843.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;Harry Kane ho&agrave;n th&agrave;nh b su tp b&agrave;n thng v&agrave;o li tt c c&aacute;c CLB anh tng i u.</h2>\r\n\r\n<p>Ch 9 ph&uacute;t sau, t s &atilde; c n&acirc;ng l&ecirc;n 2-0 cho i kh&aacute;ch. Tip tc l&agrave; mt sai lm ca h&agrave;ng th i ch nh&agrave; to c hi cho Christian Eriksen thoi m&aacute;i cm b&oacute;ng, cn chnh trc khi tung c&uacute; s&uacute;t him h&oacute;c khin th th&agrave;nh Etheridge ch c&ograve;n bit ch&ocirc;n ch&acirc;n.</p>\r\n\r\n<p>Tip &agrave; hng phn, Spurs y cao i h&igrave;nh tn c&ocirc;ng v&agrave; c&oacute; b&agrave;n thng th ba v&agrave;o li Cardiff  ph&uacute;t 26. Ngi lp c&ocirc;ng ln n&agrave;y l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Son+Heung-min-search/\" target=\"_blank\">Son Heung-min</a>. Tin o ngi H&agrave;n Quc khng ch kh&eacute;o l&eacute;o ng chuyn ca Harry Kane trc khi tung c&uacute; dt im  t th kh&oacute; buc Etheridge phi v&agrave;o li nht b&oacute;ng.&nbsp;</p>\r\n\r\n<p><img alt=\"Son Heung-min ghi bn a Tottenham tr li v tr th 2 - Bng \" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/02/so-02-0844.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;Son Heung-min duy tr&igrave; phong  l&agrave;m b&agrave;n n tng c&ugrave;ng Spurs.</h2>\r\n\r\n<p><strong>Ch&acirc;n s&uacute;t ngi H&agrave;n Quc ang c&oacute; phong  thng hoa ti Premier League khi trc tip tham gia v&agrave;o 11 b&agrave;n thng trong 8 ln &aacute; ch&iacute;nh gn nht</strong>&nbsp;(8 b&agrave;n, 3 kin to).</p>\r\n\r\n<p>3 b&agrave;n thua sm &atilde; &aacute;nh sp &yacute; ch&iacute; chin u ca c&aacute;c cu th Cardiff. Tottenham c&oacute; th thi u ung dung trong thi gian c&ograve;n li ca trn u m&agrave; kh&ocirc;ng phi lo lng v vic i th s li ln ngc d&ograve;ng nh v&ograve;ng u trc. C hi thnh thong xut hin, nhng Harry Kane c&ugrave;ng ng i kh&ocirc;ng th tn dng  ghi th&ecirc;m b&agrave;n thng.</p>\r\n\r\n<p>Ting c&ograve;i ca trng t&agrave;i ch&iacute;nh Kevin Friend vang l&ecirc;n vi&nbsp;<a href=\"http://www.bongda.com.vn/tottenham-dai-thang-trong-ngay-premier-league-chinh-thuc-chao-thua-harry-kane-d479508.html\" target=\"_blank\">thng li 3-0 d&agrave;nh cho i kh&aacute;ch</a>. Tottenham &ograve;i li v tr&iacute; th 2 t tay Man City vi 1 im nhiu hn nhng vn k&eacute;m 6 im so vi i u bng Liverpool.</p>\r\n', 'Anh', 1),
(18, 'hoduc17', , 'erkjwgrbjfndsjksffffffffffffffffffffffffffffffffffffffffffffffffffff', 'gdfggdfgdfgfdgdfgfdsfdsfdsfsfffdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdffdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdffdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdffdf', '<p>fdsfsfsdfaffsf</p>\r\n', 'AnhPhap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(19, 'hoduc17', , '5 im nhn Man City 2-1 Liverpool: Salah b \"b ti\"; The Kop v mng cp vng', 'Chui trn bt bi ca Liverpool  b ct t, qua  h khng th lp li k tch ca Arsenal  ma 2003/2004 khi v ch m khng  thua trn no.', '<p><strong>1. Sergio Aguero &ndash; &ldquo;hung thn ca Liverpool&rdquo;</strong></p>\r\n\r\n<p>Ph&uacute;t 40, nhn b&oacute;ng trong v&ograve;ng cm  g&oacute;c kh&aacute; hp, Sergio Aguero sau mt nhp khng ch &atilde; tung ra c&uacute; &aacute; tr&aacute;i ph&aacute; bng ch&acirc;n tr&aacute;i l&agrave;m tung n&oacute;c li ca th th&agrave;nh Alisson, m t s trn u.</p>\r\n\r\n<p><img alt=\"sau trn - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/9-0609.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Aguero l&agrave; hung thn ca Liverpooll.</h2>\r\n\r\n<p>Vi b&agrave;n thng n&agrave;y, &quot;Kun&quot; Aguero &atilde; c&oacute; n 7 b&agrave;n thng trong 7 ln gn nht chm tr&aacute;n Liverpool, tt c u thc hin tr&ecirc;n s&acirc;n Etihad. R&otilde; r&agrave;ng ch&acirc;n s&uacute;t ngi Argentina l&agrave; ni &aacute;m nh i vi h&agrave;ng ph&ograve;ng ng The Kop.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Thm ha Dejan Lovren</strong></p>\r\n\r\n<p>Cui c&ugrave;ng iu m&agrave; c&aacute;c CV Liverpool lo lng nht &atilde; xy ra, mt x&iacute;ch yu nht trong i h&igrave;nh ca The Kop &ndash; Dejan Lovren &atilde; b i th khai th&aacute;c trit  v&agrave; tr th&agrave;nh thm ha trong trn u n&agrave;y.</p>\r\n\r\n<p><img alt=\"sau trn - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/10-0609.jpg\" width=\"962\" /></p>\r\n\r\n<h2>Lovren mc sai lm  b&agrave;n thua u ti&ecirc;n.&nbsp;</h2>\r\n\r\n<p> b&agrave;n thua u ti&ecirc;n Lovren  Leroy Sane vt mt, sau &oacute; anh cng  Aguero t do nhn b&oacute;ng v&agrave; dt im trong v&ograve;ng cm.  b&agrave;n thua th hai trung v ngi Croatia chn sai v tr&iacute; khi h&agrave;ng ph&ograve;ng ng &atilde; d&acirc;ng l&ecirc;n t by vit v. Cha k nhng ln cu th 29 tui n&agrave;y chuyn sai,  mt b&oacute;ng trong v&ograve;ng cm&hellip;</p>\r\n\r\n<p><img alt=\"sau trn - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/13-0609.jpg\" width=\"1366\" /></p>\r\n\r\n<h2>B&agrave;n thua th 2 ca Liverpool cng xut ph&aacute;t t sai lm ca Lovren.&nbsp;</h2>\r\n\r\n<p><strong>3. Qu&aacute; en cho The Kop</strong></p>\r\n\r\n<p>Ph&uacute;t 18, c&uacute; ph&aacute; b&oacute;ng ca John Stones sau c&uacute; dt im di ct dc ca Mane &atilde; p tr&uacute;ng Ederson di ngc v ph&iacute;a khung th&agrave;nh trng ca Man City, th nhng rt may mt ln na Stones kp l&ugrave;i v ph&aacute; b&oacute;ng trc khi b&oacute;ng i qua vch v&ocirc;i.</p>\r\n', 'AnhTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(20, 'hoduc17', , 'Sao Liverpool: \"Chng ti thua Man City v thiu may mn\"', 'Georginio Wijnaldumcho rng Liverpool thua Man City v thiu may mn.', '<p>L&agrave;m kh&aacute;ch tr&ecirc;n s&acirc;n Etihad ca Man City,&nbsp;<a href=\"http://www.bongda.com.vn/Liverpool-search/\" target=\"_blank\">Liverpool</a>&nbsp;&atilde; tri qua 90 ph&uacute;t kh&ocirc;ng h d d&agrave;ng trc i th. D&ugrave; to ra kh&ocirc;ng &iacute;t c hi nguy him v&agrave; thm ch&iacute; &atilde; tin s&aacute;t n vic li ngc d&ograve;ng, tuy nhi&ecirc;n, cui c&ugrave;ng The Kop vn phi chp nhn tht bi 1-2 trc nhng nh&agrave; ng kim v&ocirc; ch Premier League.&nbsp;</p>\r\n\r\n<p>Kt qu n&agrave;y &atilde; khin o&agrave;n qu&acirc;n ca HLV Jurgen Klopp  i th r&uacute;t ngn khong c&aacute;ch xung ch c&ograve;n 4 im tr&ecirc;n bng xp hng.</p>\r\n\r\n<p>D&ugrave; vy, ph&aacute;t biu sau trn u, tin v ca Liverpool,&nbsp;<a href=\"http://www.bongda.com.vn/Georginio+Wijnaldum-search/\" target=\"_blank\">Georginio Wijnaldum</a>&nbsp;vn t ra b&igrave;nh thn: &quot;<em>T&ocirc;i ngh ch&uacute;ng t&ocirc;i &atilde; c&oacute; th gi&agrave;nh c 1 im v&agrave; thm ch&iacute; l&agrave; mt chin thng trc Man City.&nbsp;</em></p>\r\n\r\n<p><img alt=\"Sao Liverpool: \" src=\"http://media.bongda.com.vn/files/trong.le/2019/01/04/liverpool-1143.jpg\" width=\"810\" /></p>\r\n\r\n<p><em>Tuy nhi&ecirc;n,&nbsp;<strong>Liverpool &atilde; thua v&igrave; thiu may mn</strong>&nbsp;v&agrave; cng bi v&igrave; ch&uacute;ng t&ocirc;i kh&ocirc;ng th tn dng c nhng c hi m&igrave;nh c&oacute;. Th nhng thi im n&agrave;y, ch&uacute;ng t&ocirc;i cn phi nhanh ch&oacute;ng ly li s t tin v&agrave; hng n chin thng trong trn u k tip.&nbsp;</em></p>\r\n\r\n<p><em>Ch&uacute;ng t&ocirc;i &atilde; li&ecirc;n tip tn c&ocirc;ng Man City v&agrave; h cng vy. Ch&uacute;ng t&ocirc;i &atilde; c&oacute; th h&ograve;a hoc thng i th.  m&ugrave;a gii n&agrave;y, trong mt s trn u, ch&uacute;ng t&ocirc;i &atilde; c&oacute; may mn ng h&agrave;nh  gi&agrave;nh trn vn 3 im nhng &ecirc;m nay, iu &oacute; &atilde; kh&ocirc;ng c&ograve;n xut hin c&ugrave;ng Liverpool</em>&quot;.&nbsp;</p>\r\n', 'AnhC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(21, 'hoduc17', , 'HLV tuyn Iran cu cu lin on bng  trc thm Asian Cup 2019', 'Sau hng lot rc ri hu trng, HLV Carlos Queiroz ln ting cu cu Lin on Bng  Iran (IFA), yu cu h bo v i tuyn trc sc p t gii truyn thng v ngi hm m.', '<p>i tuyn Iran ang ng gia mu&ocirc;n tr&ugrave;ng kh&oacute; khn trong kh&acirc;u chun b cho&nbsp;Asian Cup 2019. Sau h&agrave;ng lot chn thng ca c&aacute;c tr ct l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/hlv-queiroz-chia-tay-tuyen-iran-sau-asian-cup-2019-d479071.html\" target=\"_blank\">nhng l&ugrave;m x&ugrave;m li&ecirc;n quan ti tng lai ca HLV Carlos Queiroz</a>&nbsp;v&agrave; c&acirc;u hi v tham vng thc s ca i tuyn ti gii u ti &acirc;y.</p>\r\n\r\n<p>Do &oacute;, chin lc gia ngi B &agrave;o Nha &atilde; phi l&ecirc;n ting cu cu IFA nhm m bo i tuyn c&oacute; s tp trung ti a cho kh&acirc;u chun b khi m&agrave; gii u &atilde; cn k.&nbsp;</p>\r\n\r\n<p><img alt=\"HLV tuyn Iran cu cu lin on bng  trc thm Asian Cup 2019 - Bng \" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/04/ir-02-1144.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;HLV Queiroz phi l&ecirc;n ting cu cu IFA.&nbsp;</h2>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i mun chun b cho gii u vi s tp trung cao  v&agrave;&nbsp;<strong>mong Ch tch IFA&nbsp;Mehdi Taj bo v ch&uacute;ng t&ocirc;i khi nhng c&aacute; nh&acirc;n g&acirc;y phin phc, thng xuy&ecirc;n t nghi vn v tham vng thc s ca i nh&agrave;</strong>. &acirc;y kh&ocirc;ng phi thi im th&iacute;ch hp cho nhng rc ri, v&agrave; ch&uacute;ng t&ocirc;i cn phi c bo v trc nhng con c&aacute; su&quot;</em>, chin lc gia ngi B &agrave;o Nha nhn mnh.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i ang tp trung cho trn m m&agrave;n gp i tuyn Yemen.  nhng gii u nh n&agrave;y, trn u u ti&ecirc;n lu&ocirc;n v&ocirc; c&ugrave;ng kh&oacute; khn. Ch&uacute;ng t&ocirc;i cn mt chin thng. Kh&ocirc;ng cn n&oacute;i cng bit, Iran &atilde; kh&ocirc;ng v&ocirc; ch gii u t hn 40 nm nay ri. C&aacute;c i b&oacute;ng ti Iran cng ang c&oacute; vn  ca ri&ecirc;ng h&quot;</em>, &ocirc;ng cho bit th&ecirc;m.&nbsp;</p>\r\n\r\n<p>Ti gii u ln n&agrave;y, HLV&nbsp;<a href=\"http://www.bongda.com.vn/Carlos+Queiroz-search/\" target=\"_blank\">Queiroz</a>&nbsp;mang sang UAE 18 cu th tng c&ugrave;ng &ocirc;ng chinh chin ti&nbsp;World Cup 2018&nbsp;tr&ecirc;n t Nga. D&ugrave; c&oacute; i h&igrave;nh rt mnh nhng chin lc gia 65 tui ch t mc ti&ecirc;u khi&ecirc;m tn l&agrave; lt ti b&aacute;n kt.</p>\r\n\r\n<p>Bi vy, rt nhiu CV t ra ho&agrave;i nghi v tham vng cng nh t&acirc;m huyt ca &ocirc;ng d&agrave;nh cho i tuyn Iran.&nbsp;</p>\r\n\r\n<p><img alt=\"HLV tuyn Iran cu cu lin on bng  trc thm Asian Cup 2019 - Bng \" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/04/ir-03-1145.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;HLV Queiroz kh&ocirc;ng nhn c s ng h &uacute;ng mc t CV nh&agrave;.&nbsp;</h2>\r\n\r\n<p><em>&quot;Khi t&ocirc;i nhm chc 7 nm trc, b&oacute;ng &aacute;&nbsp;<a href=\"http://www.bongda.com.vn/Iran-search/\" target=\"_blank\">Iran</a>&nbsp;thm ch&iacute; c&ograve;n run s trc c Bahrain. V&agrave; gi, t&ocirc;i phi nhn mnh li mt ln na: H&agrave;n Quc, Nht Bn, Australia l&agrave; ba ng vi&ecirc;n h&agrave;ng u cho chc v&ocirc; ch. V&agrave; ch&uacute;ng t&ocirc;i s chin u ht sc cho mt sut cui c&ugrave;ng ti v&ograve;ng b&aacute;n kt&quot;</em>, HLV ngi B &agrave;o Nha gii th&iacute;ch.</p>\r\n\r\n<p>Ti Asian Cup 2019, o&agrave;n qu&acirc;n ca HLV Queiroz nm  bng D c&ugrave;ng c&aacute;c i th Iraq, Yemen v&agrave; tuyn Vit Nam.&nbsp;</p>\r\n\r\n<p>V&agrave;o ng&agrave;y 7/1 ti &acirc;y, i tuyn Iran s bt u chin dch Asian Cup vi cuc chm tr&aacute;n Yemen. Sau &oacute;,&nbsp;Team Melli&nbsp;s ln lt i u tuyn Vit Nam (12/1) v&agrave; Iraq (16/1).</p>\r\n', 'AnhTBNCN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(22, 'hoduc17', , 'Khng phi AC Milan, Chelsea s bn Morata cho CV v ch La Liga', 'Chelsea  bt ng thay i quan im trong vic chuyn nhng tin o Alvaro Morata.', '<p>Trong khong thi gian qua, truyn th&ocirc;ng Anh kh&ocirc;ng ngng a tin v vic Chelsea v&agrave; AC Milan s thc hin mt thng v trao i tin o khi The Blues s ly v Gonzalo Higuain trong khi&nbsp;<a href=\"http://www.bongda.com.vn/Alvaro+Morata-search/\" target=\"_blank\">Alvaro Morata</a>&nbsp;s ra i theo chiu ngc li.&nbsp;</p>\r\n\r\n<p>Gia nhp s&acirc;n Stamford Bridge v&agrave;o m&ugrave;a h&egrave; nm 2017 vi mc gi&aacute; l&ecirc;n n 60 triu bng, tuy nhi&ecirc;n, cu cu th Real Madrid &atilde; kh&ocirc;ng th khng nh c bn th&acirc;n  London. Anh ch c&oacute; c 15 pha lp c&ocirc;ng sau 48 trn m&ugrave;a trc v&agrave; 7 b&agrave;n sau 23 trn m&ugrave;a n&agrave;y.&nbsp;</p>\r\n\r\n<p>Vi phong  k&eacute;m n tng c&ugrave;ng k nng dt im ang b t du hi, Morata c n o&aacute;n rng &atilde; kh&ocirc;ng c&ograve;n tng lai &nbsp;<a href=\"http://www.bongda.com.vn/Chelsea-search/\" target=\"_blank\">Chelsea</a>&nbsp;v&agrave; s phi sm u qu&acirc;n cho mt i b&oacute;ng kh&aacute;c trong tng lai.&nbsp;</p>\r\n\r\n<p><img alt=\"Khng phi AC Milan, Chelsea s bn Morata cho CV v ch La Liga - Bng \" src=\"http://media.bongda.com.vn/files/trong.le/2019/01/04/morata-1-1032.jpg\" width=\"800\" /></p>\r\n\r\n<h2>Tng lai ca Morata  Chelsea ang rt bp b&ecirc;nh.&nbsp;&nbsp;</h2>\r\n\r\n<p>Tuy nhi&ecirc;n, theo th&ocirc;ng tin t t Daily Mirror, ch&acirc;n s&uacute;t ngi T&acirc;y Ban Nha nhiu kh nng s kh&ocirc;ng chuyn n AC Milan m&agrave; thay v&agrave;o &oacute;,<strong>&nbsp;Sevilla mi l&agrave; im n ca tin o 26 tui</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>i b&oacute;ng ca HLV Pablo Machin ang cnh tranh ng&ocirc;i u La Liga vi Barcelona v&agrave; Atletico Madrid khi &atilde; c&oacute; c 32 im sau 17 v&ograve;ng u, k&eacute;m hai c&acirc;u lc b tr&ecirc;n ln lt&nbsp;5 v&agrave;&nbsp;2 im. Do &oacute;, h ang rt cn b sung lc lng  tng cng sc mnh trong giai on lt v.&nbsp;</p>\r\n\r\n<p>Phi Yn | 09:14 04/01/2019</p>\r\n\r\n<p>T KH&Oacute;A</p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/chelsea-tag30/\">Chelsea</a>&nbsp;<a href=\"http://www.bongda.com.vn/ac-milan-tag13/\">AC Milan</a>&nbsp;<a href=\"http://www.bongda.com.vn/alvaro-morata-tag144/\">alvaro morata</a>&nbsp;<a href=\"http://www.bongda.com.vn/sevilla-tag1020/\">Sevilla</a></p>\r\n\r\n<p>TIN MI C&Ugrave;NG CHUY&Ecirc;N MC</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/bi-gerrard-moi-cuop-cho-sao-liverpool-tinh-duong-roi-anfield-d479793.html\">B &quot;Gerrard mi&quot; cp ch, sao Liverpool t&iacute;nh ng ri Anfield</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/soc-mua-quang-hai-50-trieu-do-va-khien-anh-phuc-vu-dtqg-trung-quoc-d479781.html\">Sc! &quot;Mua Quang Hi 50 triu &ocirc; v&agrave; khin anh phc v TQG Trung Quc&quot;</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/dung-la-da-co-de-nghi-tu-man-utd-that-kho-de-toi-khong-nghi-ve-ho-d479772.html\">&quot;&uacute;ng l&agrave; &atilde; c&oacute;  ngh t Man Utd. Tht kh&oacute;  t&ocirc;i kh&ocirc;ng ngh v h&quot;</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/xong-ramsey-ky-thoa-thuan-gia-nhap-ben-do-moi-luong-65-trieu-euro-mua-d479773.html\">Xong! Ramsey k&yacute; tha thun gia nhp bn  mi, lng 6.5 triu euro/m&ugrave;a</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/khong-chi-ramsey-juventus-con-tinh-chieu-mo-ca-sao-man-united-d479766.html\">Kh&ocirc;ng ch Ramsey, Juventus c&ograve;n t&iacute;nh chi&ecirc;u m c sao Man United</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/man-utd-co-dong-thai-cu-the-vi-tien-dao-40-trieu-euro-nguoi-nhat-ban-d479758.html\">Man Utd c&oacute; ng th&aacute;i c th v&igrave; tin o 40 triu euro ngi Nht Bn</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/messi-chi-ra-5-cai-ten-barcelona-nen-mua-d479735.html\">Messi ch ra 5 c&aacute;i t&ecirc;n Barcelona n&ecirc;n mua</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/chuyen-nhuong-03-01-mu-chot-2-bom-tan-ra-gia-ban-bailly-2-cai-ten-roi-chelsea-d479712.html\">Chuyn nhng 03/01: M.U cht 2 &#39;bom tn&#39;, ra gi&aacute; b&aacute;n Bailly; 2 c&aacute;i t&ecirc;n ri Chelsea</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/10-ngoi-sao-dang-mua-nhat-o-premier-league-mua-he-2019-d479718.html\">10 ng&ocirc;i sao &aacute;ng mua nht  Premier League m&ugrave;a H&egrave; 2019</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/rat-nhanh-man-utd-ra-de-nghi-khien-trung-ve-dang-cap-lung-lay-d479716.html\">Rt nhanh! Man Utd ra  ngh khin trung v ng cp lung lay</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/chua-den-man-utd-pochettino-da-doi-ed-woodward-mua-sao-70-trieu-bang-cua-leicester-d479706.html\">Cha n Man Utd, Pochettino &atilde; &ograve;i Ed Woodward mua sao 70 triu bng ca Leicester</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/nong-fenerbahce-tien-gan-toi-chu-ky-cua-tro-cung-mourinho-nhung-that-sung-duoi-tay-solskjaer-d479715.html\">N&oacute;ng! Fenerbahce tin gn ti ch k&yacute; ca &#39;tr&ograve; cng&#39; Mourinho nhng &#39;tht sng&#39; di tay Solskjaer</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/sao-chelsea-dat-thoa-thuan-voi-monaco-su-that-soc-lien-quan-den-pogba-mu-va-barca-d479684.html\">Sao Chelsea t tha thun vi Monaco, s tht sc li&ecirc;n quan n Pogba, MU v&agrave; Barca</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/christian-pulisic-la-mot-thuong-vu-nong-voi-cua-chelsea-d479590.html\">Christian Pulisic l&agrave; mt thng v... &quot;n&oacute;ng vi&quot; ca Chelsea?</a></h3>\r\n	</li>\r\n</ul>\r\n', 'AnhTBNC1CN', 1),
(23, 'hoduc17', , 'Messi mun Barca chi 162 triu bng v ngi sao ny, Arsenal  mt trung v thnh Turin', 'Sau khi Chelsea n bom tn mang tn Christian Pulisic, cc i gia khc  chu u cng khng chu ngi yn.', '<p>T Marca mi &acirc;y &atilde; a ra mt th&ocirc;ng tin kh&aacute; bt ng. H tit l si&ecirc;u sao&nbsp;<a href=\"http://www.bongda.com.vn/ket-thuc-nam-2018-messi-van-la-sat-thu-dang-so-nhat-d479455.html\" target=\"_blank\">Lionel Messi</a>&nbsp;rt mun Neymar tr li s&acirc;n Nou Camp. Messi cho hay anh ngng m t&agrave;i nng ca tin o ang trong bi&ecirc;n ch PSG v&agrave; rt mun t&aacute;i hp vi Neymar d&ugrave; mi chuyn hi phc tp.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi mun Barca chi 162 triu bng v ngi sao ny, Arsenal  mt trung v thnh Turin - Bng \" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/neymar-vs-cavani-phat-den-2012.jpg\" width=\"630\" /></p>\r\n\r\n<h2>&nbsp;Neymar kh&ocirc;ng hnh ph&uacute;c  PSG.&nbsp;</h2>\r\n\r\n<p>Messi chia s:<em>&nbsp;&quot;Neymar tr li Barca ? T&ocirc;i thy iu n&agrave;y hi phc tp. Ch&uacute;ng t&ocirc;i y&ecirc;u cu y v&agrave; mun cu y tr li, trong c t c&aacute;ch cu th ln mt ngi bn trong ph&ograve;ng thay .&nbsp;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Ch&uacute;ng t&ocirc;i l&agrave; bn, ch&uacute;ng t&ocirc;i chia s nhng khonh khc ngt ng&agrave;o v&agrave; c nhng l&uacute;c kh&ocirc;ng vui. Nhng ch&uacute;ng t&ocirc;i d&agrave;nh cho nhau kh&aacute; nhiu thi gian. T&ocirc;i thy hi kh&oacute;  anh y ri Paris. PSG kh&ocirc;ng mun Neymar ra i,&quot;&nbsp;</em>Messi nhn nh.&nbsp;</p>\r\n\r\n<p><strong>Chiu theo &yacute; ca Messi, BL Barca &atilde; a PSG li  ngh 162 triu bng  mua li Neymar.</strong>&nbsp;Thc t, t khi chuyn n Paris, Neymar lu&ocirc;n gp nhng rc ri tr&ecirc;n s&acirc;n c ln ngo&agrave;i s&acirc;n u. Anh c cho l&agrave; kh&ocirc;ng c l&ograve;ng c&aacute;c ng i, trong khi &oacute; PSG kh&ocirc;ng th i s&acirc;u &nbsp;<a href=\"http://www.bongda.com.vn/champions-league/\" target=\"_blank\">Champions League</a>.&nbsp;Hin ti, Neymar &atilde; tr v qu&ecirc; nh&agrave;  ngh &ocirc;ng v&agrave; cha tr dt im chn thng.&nbsp;</p>\r\n\r\n<p>Trong khi &oacute;&nbsp;<a href=\"http://www.bongda.com.vn/pulisic-va-nhung-ban-hop-dong-dat-gia-nhat-lich-su-chelsea-d479606.html\" target=\"_blank\">sau Chelsea</a>, Arsenal l&agrave; i b&oacute;ng gn nht c&oacute; th n bom tn. H&agrave;ng th va thiu va yu ca Arsenal ang khin &aacute;nh ri kh&aacute; nhiu im s trong nhng v&ograve;ng u gn &acirc;y.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi mun Barca chi 162 triu bng v ngi sao ny, Arsenal  mt trung v thnh Turin - Bng \" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/3-2021.jpg\" width=\"630\" /></p>\r\n\r\n<h2>&nbsp;H&agrave;ng th Arsena cn c n&acirc;ng cp.&nbsp;</h2>\r\n\r\n<p>Ngay lp tc BL Arsenal &atilde; c&oacute; nhng phng &aacute;n  gia c tuyn di, c bit l&agrave; v tr&iacute; trung v. Theo &oacute;, Ph&aacute;o th &atilde; c&oacute; nhng li&ecirc;n h vi&nbsp;Nicolas N&rsquo;Koulou ca Torino. Anh l&agrave; i trng ca Cameroon v&agrave; ch c&oacute; gi&aacute; khong 3,5 triu bng tr&ecirc;n TTCN.</p>\r\n\r\n<p>Thc t, thc lc ca Arsenal kh&oacute; l&ograve;ng tranh chp nhng mc ti&ecirc;u ln vi nhng &ocirc;ng ln c&ograve;n li ca Premier League.&nbsp;H cng kh&ocirc;ng th mo him bi mua b&aacute;n  th&aacute;ng Gi&ecirc;ng thng n cha nhiu ri ro.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi mun Barca chi 162 triu bng v ngi sao ny, Arsenal  mt trung v thnh Turin - Bng \" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/nkoulou-2044.jpg\" width=\"696\" /></p>\r\n\r\n<h2>&nbsp;N&rsquo;Koulou l&agrave; s la chn hp l&iacute; ca Arsenal v&agrave;o th&aacute;ng Gi&ecirc;ng.&nbsp;</h2>\r\n\r\n<p>Nkoulou c &aacute;nh gi&aacute; l&agrave; mt cu th  tt  v&aacute; v&iacute;u h&agrave;ng th gp qu&aacute; nhiu vn  ca i ch s&acirc;n Emirates. Anh c &aacute;nh gi&aacute; cao bi kh nng tranh chp v&agrave; s tp trung.&nbsp;</p>\r\n\r\n<p>M&ugrave;a n&agrave;y, anh l&agrave; tr ct ca Torino, ra s&acirc;n  19 trn v&agrave; ghi c 2 b&agrave;n thng. &aacute;ng ch&uacute; &yacute;, kh nng d&ugrave;ng ch&acirc;n ca&nbsp;Nkoulou kh&aacute; n tng vi vic thc hin th&agrave;nh c&ocirc;ng 92% s ng chuyn.&nbsp;</p>\r\n\r\n<p><strong>Nhng pha b&oacute;ng hay ca Neymar:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nga Long | 21:09 02/01/2019</p>\r\n', 'AnhPhapC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(24, 'hoduc17', , 'Xong! Ramsey k tha thun gia nhp bn  mi, lng 6.5 triu euro/ma', 'im n ca ngi sao Arsenal c nhiu i bng ln thm kht  sng t.', '<p>Tng lai ca Aaron Ramsey l&agrave; ch  &atilde; c b&agrave;n t&aacute;n sut nhiu th&aacute;ng qua. Hp ng hin ti ca tuyn th X Wales ti Emirates s &aacute;o hn khi m&ugrave;a gii 2018/19 kh&eacute;p li v&agrave; qu&aacute; tr&igrave;nh thng tho gia hn vi&nbsp;<a href=\"http://www.bongda.com.vn/arsenal-search/\" target=\"_blank\">Arsenal</a>&nbsp;&atilde;  v, ng ngha anh s ra i sau hn 10 nm gn b&oacute;.</p>\r\n\r\n<p>D&ugrave; kh&ocirc;ng c BL Ph&aacute;o Th quyt t&acirc;m gi ch&acirc;n nhng&nbsp;<a href=\"http://www.bongda.com.vn/10-ngoi-sao-dang-mua-nhat-o-premier-league-mua-he-2019-d479718.html\" target=\"_blank\">kh nng ca Ramsey l&agrave; iu kh&ocirc;ng b&agrave;n c&atilde;i</a>. Ng&ocirc;i sao 28 tui l&agrave; mt trong nhng tin v h&agrave;ng u Ch&acirc;u &Acirc;u nhng nm qua v&agrave; c nhiu i gia kh&aacute;c tri thm sn &oacute;n, bao gm c&aacute;c i th ca Arsenal ti Premier League nh Manchester United hay Liverpool.</p>\r\n\r\n<p><img alt=\"Juve k Ramsey - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2019/01/04/maxresdefault-0758.jpg\" width=\"1280\" /></p>\r\n\r\n<h2>&nbsp;Ramsey &atilde; chn Juventus.</h2>\r\n\r\n<p>Tuy nhi&ecirc;n theo th&ocirc;ng tin mi nht, Ramsey &atilde; quyt nh chuyn sang &Yacute; thi u.&nbsp;Sportmediaset cho hay&nbsp;<strong>S 8 Ph&aacute;o Th &atilde; k&yacute; xong tha thun&nbsp;ghi nh&nbsp;vi Juve</strong>&nbsp;v&agrave; thm ch&iacute; c&oacute; th kho&aacute;c &aacute;o Bianconeri ngay trong th&aacute;ng n&agrave;y. Mc &atilde;i ng Ramsey c hng ti Allianz s l&agrave; 6.5 triu euro/m&ugrave;a k&egrave;m iu khon cng th&ecirc;m.</p>\r\n\r\n<p>Th t va qua, Gi&aacute;m c Juve, Fabio Paratici tng c&ocirc;ng khai tha nhn Bianconeri ang xem x&eacute;t c&aacute;c kh nng thc hin thng v&nbsp;<a href=\"http://www.bongda.com.vn/aaron+ramsey-search/\" target=\"_blank\">Ramsey</a>.</p>\r\n\r\n<p>Phng S | 07:25 04/01/2019</p>\r\n', 'AnhPhapTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(25, 'ducdeptrai', , 'Ri Man Utd, Jose Mourinho s v u?', 'Tng lai ca Jose Mourinho cha c g r rng sau khi b Manchester United sa thi.', '<p>Tng lai ca Jose Mourinho cha c&oacute; g&igrave; r&otilde; r&agrave;ng sau khi b Manchester United sa thi.</p>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s1-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;HLV Jose Mourinho &atilde; b Man United sa thi c&aacute;ch &acirc;y kh&ocirc;ng l&acirc;u sau tht bi nng n 1-3 trc Liverpool.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s2-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Hin ti, chin lc gia ngi B &agrave;o Nha vn ang tht nghip.</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/10-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;D&ugrave; vy, vi t&agrave;i nng v&agrave; s danh hiu  s &atilde; ot c trong qu&aacute; kh, Mourinho vn l&agrave; c&aacute;i t&ecirc;n hot i vi nhiu i b&oacute;ng ln.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/7-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Real Madrid c cho l&agrave; im n kh d nht ca &#39;Ngi c bit&#39;.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s8-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tng c&oacute; thi gian l&agrave;m vic  &acirc;y, Mourinho kh&ocirc;ng qu&aacute; xa l vi bu kh&ocirc;ng kh&iacute; s&acirc;n Bernabeu.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s9-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Nu kh&ocirc;ng c&oacute; g&igrave; bt ng, Mourinho s l&ecirc;n thay th Solari ngay khi m&ugrave;a gii n&agrave;y kt th&uacute;c.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s5-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Inter Milan cng l&agrave; im n tim nng kh&aacute;c. Ti Italia, Mourinho tng gi&uacute;p CLB Inter Milan ot c&uacute; n ba v i m&ugrave;a gii 2009/10.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s6-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tuy nhi&ecirc;n,&nbsp;trog b&agrave;i phng vn mi &acirc;y vi Sky Sports Italia, &iacute;ch th&acirc;n Gi&aacute;m c th thao Piero Ausilio &atilde; l&ecirc;n ting khng nh Inter vn tin tng  Spalletti.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s4-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;C th, Ausilio tha nhn: &quot;K hoch ca CLB vn ang tip din sau 1 nm ri vi Spalletti v&agrave; s tip tc i c&ugrave;ng &ocirc;ng y nhiu nm na.&quot;</h2>\r\n\r\n<p><img alt=\"Jose Mourinho b i bng c khc t - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s3-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;V&agrave;i nm qua, s nghip ca Mourinho kh&ocirc;ng c&oacute; qu&aacute; nhiu ni bt. Phng ph&aacute;p ca &ocirc;ng b cho l&agrave; &atilde; ht hiu qu khi li&ecirc;n tip b sa thi  nhng ni &ocirc;ng i qua.</h2>\r\n', 'AnhTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(26, 'ducdeptrai', , 'Herrera ch ra thay i ln nht ca Pogba t khi Mourinho b sa thi', 'Tin v Ty Ban Nha a ra nhn xt v bin chuyn ca ngi ng i.', '<p>Paul Pogba tng b &agrave;y i trong giai on cui triu i&nbsp;<a href=\"http://www.bongda.com.vn/jose+mourinho-search/\" target=\"_blank\">Jose Mourinho</a>, nhng vic t&acirc;n HLV Ole Gunnar Solskjaer tip qun &atilde; m ra khi u mi vi tuyn th Ph&aacute;p.</p>\r\n\r\n<p>Chin lc gia ngi Na Uy&nbsp;<a href=\"http://www.bongda.com.vn/toi-chac-chan-chac-chan-dang-nhin-thay-pogba-tot-nhat-minh-tung-biet-d479569.html\" target=\"_blank\">trao cho Pogba s t do nhiu hn</a>. &aacute;p li, tin v 25 tui ta s&aacute;ng rc r khi g&oacute;p c&ocirc;ng 4 b&agrave;n thng c&ugrave;ng 3 ng kin to trong 4 thng li li&ecirc;n tip va qua ca Manchester United.</p>\r\n\r\n<p><img alt=\"Herrera ch ra s thay i ca Pogba k t khi Mourinho ra i - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2019/01/04/gettyimages-1075936970-1150.jpg\" width=\"540\" /></p>\r\n\r\n<h2>&nbsp;Pogba b&ugrave;ng n  triu i mi.</h2>\r\n\r\n<p>S gii ph&oacute;ng tinh thn cng gi&uacute;p Pogba t&iacute;ch cc &oacute;ng g&oacute;p cho li chi chung hn, bng c&aacute;ch tranh chp t&aacute;i chim quyn kim so&aacute;t, iu Ander Herrera xem nh thay i ln nht ca ngi ng i k t sau bin ng tr&ecirc;n bng gh ch o.</p>\r\n\r\n<p><em>&quot;Paul ang chi rt, rt tt.&quot;</em>&nbsp;Metro dn li Herrera.&nbsp;<em>&quot;Kh&ocirc;ng ch vi b&oacute;ng, t&ocirc;i ngh ngay khi ch&uacute;ng t&ocirc;i mt b&oacute;ng,&nbsp;<strong>cu y sn s&agrave;ng ph&ograve;ng ng, sn s&agrave;ng gi&uacute;p  tp th.</strong>&quot;</em></p>\r\n\r\n<p><em>&quot;Paul thi u rt n gin v&agrave; hiu qu  phn s&acirc;n nh&agrave;. Khi bc sang na kia s&acirc;n, cu y s hu ma thut  thay i cc din trn u. V&igrave; vy, ch&uacute;ng t&ocirc;i tht s vui cho&nbsp;<a href=\"http://www.bongda.com.vn/paul+pogba-search/\" target=\"_blank\">Paul</a>.&quot;</em></p>\r\n\r\n<p>Phng S | 11:10 04/01/2019</p>\r\n', 'AnhC1CN', 1),
(27, 'ducdeptrai', , '\"Cu ta gp may khi p vo i Pogba\"', 'Phn tch trn Sky Sports, cu trng ti Anh Dermot Gallagher khng nh, Jonjo Shelvey  c tnh hung chi xu Paul Pogba.', '<p>Tr&ecirc;n s&acirc;n St James&#39; Park  v&ograve;ng 21 Premier League, Man United&nbsp;&atilde; gi&agrave;nh c chin thng 2-0 trc Newcastle nh c&aacute;c pha lp c&ocirc;ng ca&nbsp;Romelu Lukaku v&agrave; Marcus Rashford. &acirc;y l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/thang-4-tran-lien-solskjaer-tro-lai-lowry-vao-khuya-muon-d479708.html\" target=\"_blank\">chin thng th 4 li&ecirc;n tip</a>&nbsp;cho&nbsp;Qu  di thi&nbsp;Ole Gunnar Solskjaer.</p>\r\n\r\n<p>Tuy vy, vn c&oacute; t&igrave;nh hung tranh c&atilde;i n ra khi&nbsp;Jonjo Shelvey c&oacute;&nbsp;pha p thng v&agrave;o &ugrave;i Paul Pogba. &aacute;ng ch&uacute; &yacute;, kh&ocirc;ng c&oacute; tm th  n&agrave;o c r&uacute;t ra.&nbsp;Ph&acirc;n t&iacute;ch tr&ecirc;n Sky Sports, cu trng t&agrave;i Anh Dermot Gallagher cho rng,&nbsp;Jonjo Shelvey &atilde; gp may.</p>\r\n\r\n<p><img alt=\"\" src=\"http://media.bongda.com.vn/files/hai.phan/2019/01/04/skysports-pogba-shelvey-paul-pogba_4536219-0720.jpg\" width=\"768\" /></p>\r\n\r\n<h2>&nbsp;T&igrave;nh hung xu chi ca Shelvey vi Pogba nhng kh&ocirc;ng c&oacute; chic th  n&agrave;o c r&uacute;t ra.</h2>\r\n\r\n<p>C th,&nbsp;Dermot Gallagher nhn nh:<em>&nbsp;&quot;<strong>&oacute; l&agrave; mt chic th  kh&ocirc;ng phi b&agrave;n c&atilde;i.</strong>&nbsp;Cu ta &atilde; chi cao ch&acirc;n vi ch &iacute;ch rt r&otilde; r&agrave;ng. Trng t&agrave;i ng sau lng&nbsp;Shelvey n&ecirc;n rt c&oacute; kh nng &ocirc;ng y &atilde; b che khut tm mt.&nbsp;Shelvey &atilde; may mn  pha b&oacute;ng n&agrave;y.&quot;</em></p>\r\n\r\n<p>Trc &oacute;, trng t&agrave;i&nbsp;Mark Clattenburg cng tuy&ecirc;n b,&nbsp;Shelvey &atilde;&nbsp;&aacute; Pogba t ph&iacute;a sau bng c gm gi&agrave;y v&agrave; iu n&agrave;y g&acirc;y nguy him cho s an to&agrave;n ca i phng.</p>\r\n\r\n<p><strong>Video t&agrave;i nng ca Pogba:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tiu Lam | 06:46 04/01/2019</p>\r\n', 'AnhTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(28, 'ducdeptrai', , 'i hnh 11 cu th t gi nht: Song st PSG \"cn\" c th gii', 'Mi y trang Transfermarkt va chn ra 11 ci tn t gi nht hin ti. PSG hin ang s hu 2 tin o cc khng l Neymar v Mbappe.', '<p>&nbsp;Mi &acirc;y trang Transfermarkt va chn ra 11 c&aacute;i t&ecirc;n t gi&aacute; nht hin ti. PSG hin ang s hu 2 tin o cc khng l&agrave; Neymar v&agrave; Mbappe.</p>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/1-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Th m&ocirc;n: Ter Stegen (80 triu euro) - Ng&ocirc;i sao ngi c lu&ocirc;n cho thy phong  n nh v&agrave; kh nng nhy b&eacute;n, thm ch&iacute; xut thn trong nhiu t&igrave;nh hung. Hin ti, vai tr&ograve; ca anh vi Barca kh&ocirc;ng h k&eacute;m si&ecirc;u sao Leo</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/2-1845.jpg\" width=\"620\" /></p>\r\n\r\n<h2>&nbsp;Hu v phi: Joshua Kimmich (60 triu euro) - T&agrave;i nng tr ngi c c&oacute; s thng tin vt bc trong v&agrave;i nm qua. Anh c xem l&agrave; ngi tha k v tr&iacute; b li ca huyn thoi Philipp Lahm trong m&agrave;u &aacute;o c&acirc;u lc b ln i tuyn quc gia.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/3-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Trung v: Van Dijk (75 triu euro) - Quyt nh b ra s tin k lc 75 triu bng ch  chi&ecirc;u m mt trung v ca Liverpool l&uacute;c n&agrave;y ang t ra &uacute;ng n khi Virgil Van Dijk ang &oacute;ng vai tr&ograve; &quot;h&ograve;n &aacute; tng&quot; ni h&agrave;ng th The Kop l&uacute;c n&agrave;y. Hin o&agrave;n qu&acirc;n ca HLV Jurgen Klopp ch  thng li 7 b&agrave;n sau 19 v&ograve;ng u Premier League.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/4-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Trung v: Raphael Varane (80 triu euro) &ndash; Varane c&oacute; mt nm thi u th&agrave;nh c&ocirc;ng khi anh l&agrave; nh&acirc;n t ch&iacute;nh v&ocirc; ch Champions League c&ugrave;ng Real Madrid v&agrave; ot c&uacute;p v&agrave;ng World Cup c&ugrave;ng tuyn Ph&aacute;p.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/5-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Hu v tr&aacute;i: Marcelo (70 triu euro) &ndash; Cu th ngi Brazil &oacute;ng vai tr&ograve; then cht gi&uacute;p Real Madrid thng tr ch&acirc;u &Acirc;u trong 3 m&ugrave;a va qua. Mc d&ugrave; vn b ch tr&iacute;ch v&igrave; thng xuy&ecirc;n b v tr&iacute;, tuy nhi&ecirc;n mi h&agrave;ng ph&ograve;ng ng u phi e d&egrave; khi Marcelo d&acirc;ng cao tn c&ocirc;ng.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/6-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tin v ph&ograve;ng ng: N&rsquo;Golo Kante (100 triu euro) &ndash; Mc d&ugrave; &atilde; &aacute;nh mt v tr&iacute; m neo v&agrave;o tay Jorginho, tuy nhi&ecirc;n Kante hin ti vn ang c &aacute;nh gi&aacute; rt cao bi th lc sung m&atilde;n v&agrave; kh nng &ldquo;c&agrave;n qu&eacute;t&rdquo; tuyt vi  gia s&acirc;n.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/7-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tin v trung t&acirc;m: De Bruyne (150 triu euro) &ndash; Kh&ocirc;ng c&oacute; c hi th hin nhiu  m&ugrave;a n&agrave;y bi d&iacute;nh chn thng li&ecirc;n mi&ecirc;n, tuy nhi&ecirc;n kh&ocirc;ng ai d&aacute;m ph nhn t&agrave;i nng ca &ldquo;Vua kin to&rdquo; Premier League m&ugrave;a trc.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/8-1845.jpg\" width=\"590\" /></p>\r\n\r\n<h2>&nbsp;Tin v tn c&ocirc;ng: Eden Hazard (150 triu euro) &ndash; Hin cu th ngi B ang l&agrave; nim cm hng trong li chi tn c&ocirc;ng ca Chelsea. Hazard cng ang nm trong mc ti&ecirc;u chuyn nhng ca Real Madrid.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/9-1845.jpg\" width=\"640\" /></p>\r\n\r\n<h2>&nbsp;Tin o phi: Lionel Messi (160 triu euro) &ndash; Si&ecirc;u sao ngi Argentina vn ang cho thy ng cp kh&aacute;c bit vi phn c&ograve;n li. Tuy nhi&ecirc;n gi&aacute; tr ca Messi b nh hng bi anh &atilde; 31 tui.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/10-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tin o tr&aacute;i: Neymar (180 triu euro) &ndash; Gi&aacute; tr ca Neymar c&oacute; phn gim s&uacute;t bi anh chi kh&ocirc;ng th&agrave;nh c&ocirc;ng  m&ugrave;a gii nm ngo&aacute;i trong m&agrave;u &aacute;o PSG v&agrave; tuyn Brazil.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/11-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Tin o cm: Kylian Mbappe (200 triu euro) - &nbsp;Vic li&ecirc;n tip gi&agrave;nh danh hiu Cu b&eacute; v&agrave;ng, Cu th tr hay nht World Cup, Cu th tr xut sc nht nm cng nh nhng m&agrave;n to s&aacute;ng rc r trong m&agrave;u &aacute;o PSG v&agrave; tuyn Ph&aacute;p, Mbappe c nh gi&aacute; cao nht th gii hin nay.</h2>\r\n\r\n<p><img alt=\"i hnh t gi nht theo Transfermarkt - Bng \" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/12-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;i h&igrave;nh 11 cu th t gi&aacute; nht do&nbsp;Transfermarkt b&igrave;nh chn.</h2>\r\n', 'AnhDucTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(29, 'ducdeptrai', , 'Chnh thc! \"Effenberg  nh\" chia tay Dortmund', 'Dortmund  ni li chia tay vi tin v trung tm Sebastian Rode trong giai on cn li ca ma gii.', '<p>Trng th&agrave;nh t l&ograve; &agrave;o to tr ca&nbsp;Kickers Offenbach, g&acirc;y ting vang &nbsp;Eintracht Frankfurt trc khi khin c th gii ch&uacute; &yacute; khi u qu&acirc;n cho &quot;g&atilde; khng l nc c&quot;, Bayern Munich, s nghip ca Sebastian Rode ta nh mt bn giao hng vi rt nhiu nhng nt thng dn dt anh n nh cao ca l&agrave;ng b&oacute;ng &aacute; x German.</p>\r\n\r\n<p>S hu li chi mnh m, kh nng tranh chp n tng, nhng c&uacute; s&uacute;t xa tr&aacute;i ph&aacute; c&ugrave;ng phong c&aacute;ch quyt lit, kh&ocirc;ng khoan nhng, tin v 28 tui tng c k vng s tr th&agrave;nh mt &quot;Stefan Effenberg  nh&quot;  s&acirc;n Allianz Arena. c bit khi ngay  m&ugrave;a b&oacute;ng u ti&ecirc;n c&ugrave;ng &quot;H&ugrave;m x&aacute;m&quot;, anh &atilde; ra s&acirc;n trong 35 trn v&agrave; &oacute;ng g&oacute;p 3 b&agrave;n thng cho i b&oacute;ng x Bavaria.&nbsp;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, &uacute;ng thi im&nbsp;<a href=\"http://www.bongda.com.vn/Sebastian+Rode-search/\" target=\"_blank\">Rode</a>&nbsp;ang chi hay v&agrave; ang dn khng nh m&igrave;nh tr&ecirc;n bn  b&oacute;ng &aacute; th gii th&igrave; bc ngot li xy n. Chn thng khin tin v 28 tui ch c&ograve;n ra s&acirc;n 17 trn cho Bayern Munich v&agrave; khi anh tr li, khu trung tuyn cht chi ca HLV Pep Guardiola vi nhng c&aacute;i t&ecirc;n lng danh nh Xabi Alonso, Thiago Alcantara, Arturo Vidal hay Philipp Lahm &atilde; khin anh kh&ocirc;ng c&ograve;n c hi t&igrave;m li v th xa c ca m&igrave;nh.&nbsp;</p>\r\n\r\n<p><img alt=\"Chnh thc! \" src=\"http://media.bongda.com.vn/files/trong.le/2018/12/28/rode-2-1221.jpg\" width=\"680\" /></p>\r\n\r\n<h2>Rode tng c k vng s tr th&agrave;nh &quot;Effenberg  nh&quot;  Bayern Munich tuy nhi&ecirc;n v&igrave; nhng l&yacute; do kh&aacute;c nhau, anh &atilde; &aacute;nh mt v tr&iacute; ca m&igrave;nh ti Allianz Arena.&nbsp;</h2>\r\n\r\n<p>Khi c&oacute; c 100% phong  v&agrave; th lc, Rode &oacute;ng vai tr&ograve; l&agrave; mt &quot;qu&acirc;n b&agrave;i chin lc&quot; ca chin lc gia ngi T&acirc;y Ban Nha. Nhng khi tr li sau chn thng v&agrave; cn thi gian  t&igrave;m li ch&iacute;nh m&igrave;nh, anh chng kh&aacute;c n&agrave;o mt &quot;ngi tha&quot;  Bayern Munich khi &atilde; ho&agrave;n to&agrave;n &quot;l nhp&quot; trong ch&iacute;nh bn giao hng cuc i.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kh&aacute;c vi Javi Martinez, mt &quot;c&ocirc;ng thn&quot; Bayern kh&aacute;c chp nhn  li Allianz Arena  &quot;truy kim&quot; thi ho&agrave;ng kim, Rode kh&ocirc;ng chp nhn t&igrave;nh cnh hin ti v&agrave; anh &atilde; quyt nh&nbsp;<a href=\"http://www.bongda.com.vn/sebastian-rode-roi-bayern-gia-nhap-dortmund-d348410.html\" target=\"_blank\">gia nhp i k&igrave;nh ch</a>&nbsp;ca &quot;H&ugrave;m x&aacute;m&quot; khi &oacute;,&nbsp;<a href=\"http://www.bongda.com.vn/Borussia+Dortmund-search/\" target=\"_blank\">Borussia Dortmund</a>.&nbsp;</p>\r\n\r\n<p>n vi Signal Iduna Park, cu th ngi c mt ln na li khng nh t&agrave;i nng khi c HLV Thomas Tuchel tin tng v&agrave; &oacute;ng vai tr&ograve; nh &quot;th lnh&quot; tuyn gia ca c&acirc;u lc b &quot;V&agrave;ng v&agrave; en&quot;.</p>\r\n\r\n<p><img alt=\"Chnh thc! \" src=\"http://media.bongda.com.vn/files/trong.le/2018/12/28/rode-1-1221.jpg\" width=\"680\" /></p>\r\n\r\n<h2>Gia nhp Dortmund, Rode &atilde; tng c&oacute; khong thi gian th&agrave;nh c&ocirc;ng nhng cng kh&ocirc;ng &iacute;t ln nm m&ugrave;i cay ng. Hin ti, anh &atilde; chn gia nhp Frankfurt theo dng cho mn n ht m&ugrave;a gii.&nbsp;&nbsp;</h2>\r\n\r\n<p>Tuy nhi&ecirc;n, gia l&uacute;c &aacute;nh s&aacute;ng hy vng tr li, s tr tr&ecirc;u ca cuc i mt ln na li &quot;d&igrave;m&quot; Rode xung vc s&acirc;u khi ngay  m&ugrave;a tip theo, HLV Peter Stoger kh&ocirc;ng trng dng anh v&agrave; &quot;Effenberg  nh&quot; mt ln na phi nm m&ugrave;i cay ng khi chp nhn th&acirc;n phn d b  Dortmund.</p>\r\n\r\n<p> ri n gi &acirc;y, sau mt khong thi gian &agrave;m ph&aacute;n, Rode &atilde; t c tha thun ri Signal Iduna Park &nbsp;<strong>tr v &quot;m&aacute;i nh&agrave; xa&quot; Frankfurt theo dng cho mn</strong>&nbsp;n ht m&ugrave;a gii.&nbsp;</p>\r\n\r\n<p>Ng&agrave;y ra i, Dortmund &atilde; gi li cm n n anh v&agrave; hy vng &quot;Effenberg  nh&quot; c&oacute; th t&igrave;m li ch&iacute;nh m&igrave;nh  i b&oacute;ng bang Hessen. C&ograve;n vi Rode, khi &atilde; tim cn tui 30, tin v ngi c n&ecirc;n hiu rng, anh s&nbsp;kh&ocirc;ng c&ograve;n nhiu thi gian  c&oacute; th phi&ecirc;u lu vi s nghip nh&nbsp;trc &oacute; na.&nbsp;</p>\r\n\r\n<p>Phi Yn | 11:12 28/12/2018</p>\r\n', 'AnhDucC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(30, 'ducdeptrai', , 'Top 30 ngi sao xut sc nht nm 2018 (phn 2): Ngi hng MU, sao Liver c 1 v tr', 'Di y l 10 ngi sao xp t v tr th 20 n 11 trong danh sch nhng ci tn xut sc nht th gii 2018 theo bnh chn ca Four Four Two.', '<p>&nbsp;Di &acirc;y l&agrave; 10 ng&ocirc;i sao xp t v tr&iacute; th 20 n 11 trong danh s&aacute;ch nhng c&aacute;i t&ecirc;n xut sc nht th gii 2018 theo b&igrave;nh chn ca Four Four Two.</p>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/ste-0247.jpg\" width=\"630\" /></p>\r\n\r\n<h2>20. Marc-Andre ter Stegen: Kh&ocirc;ng c&oacute; g&igrave; &aacute;ng b&agrave;n c&atilde;i v t&agrave;i nng c&ugrave;ng phong  ca Stegen  thi im hin ti. Vi bit danh &quot;Messi th m&ocirc;n&quot;, ng&ocirc;i sao ngi c ng&agrave;y c&agrave;ng cho thy tm quan trng vi Barcelona. Khi&ecirc;m tn, gin d cng vi kh nng, k thut thng tha, tuyn th s 1 tng bc khng nh v th trong l&agrave;ng t&uacute;c cu ln l&ograve;ng ngi h&acirc;m m.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/i5-0246.jpg\" width=\"630\" /></p>\r\n\r\n<h2>19. Virgil van Dijk: Xut sc, n tng, thuyt phc l&agrave; tt c nhng t ng d&agrave;nh tng Van Dijk. Kh&ocirc;ng cn qu&aacute; nhiu thi gian, tuyn th ngi H&agrave; Lan &atilde; g&acirc;y c ting vang ti Premier League, ng thi &aacute;p tr gay gt nhng d&egrave; bu v t&agrave;i nng ca anh. Hin ti, ng&ocirc;i sao s 4 nghim nhi&ecirc;n tr th&agrave;nh tr ct ca Liverpool v&agrave; l&agrave; ch&igrave;a kh&oacute;a th&agrave;nh c&ocirc;ng vi i nh&agrave; sut chng ng qua.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d9-0248.jpg\" width=\"630\" /></p>\r\n\r\n<h2>18. Mauro Icardi: Icardi c&oacute; c v tr&iacute; n&agrave;y n gin v&igrave; anh xng &aacute;ng. Ng&ocirc;i sao Argentina li&ecirc;n tc khuy o Serie A bng n lc, s vn l&ecirc;n v&agrave; t&agrave;i nng ca bn th&acirc;n. Vic kh&ocirc;ng th tham d World Cup 2018 r&otilde; r&agrave;ng kh&ocirc;ng nh hng n s xut sc ca ch&acirc;n s&uacute;t Nam M. Sut 1 nm qua, nhng g&igrave; tin o s 9 &oacute;ng g&oacute;p cho Inter l&agrave; &aacute;ng khen ngi.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d4-0248.jpg\" width=\"630\" /></p>\r\n\r\n<h2>17. Robert Lewandowski: Bt chp nhng n &agrave;o, l&ugrave;m x&ugrave;m v chuyn i , Lewandowski vn l&agrave; tr ct ch cht ca Bayern Munich. Ng&ocirc;i sao Ba Lan lu&ocirc;n gi vng phong  v&agrave; nm trong top c&aacute;c trung phong cm h&agrave;ng u l&agrave;ng t&uacute;c cu. Hin ti, tin o 30 tui ang cnh tranh danh hiu &quot;Vua ph&aacute; li&quot; Bundesliga vi 10 b&agrave;n thng sau 16 v&ograve;ng u.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/u-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>16. David de Gea: C&oacute; qu&aacute; nhiu iu  n&oacute;i v De Gea. Cu th ch cht, im ta ni khung g, ngi h&ugrave;ng ca Manchester United, tt c u &uacute;ng v ng&ocirc;i sao T&acirc;y Ban Nha.  tuyn th 28 tui, ngi ta lu&ocirc;n thy c tinh thn thi u nhit huyt, cng hin. &oacute; l&agrave; l&yacute; do ti sao anh vn g&aacute;nh v&aacute;c i nh&agrave; d&ugrave; li&ecirc;n tc vng l&ugrave;m x&ugrave;m ra i.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d3-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>15. Luis Suarez: Phong  Suarez nm 2018 li&ecirc;n tc g&acirc;y tranh c&atilde;i. Tuyn th ngi Uruguay kh&ocirc;ng &iacute;t ln sa s&uacute;t v&agrave; thi u t hi. Th nhng, c&ocirc;ng bng m&agrave; n&oacute;i, tin o s 9 vn s hu s nhy b&eacute;n v&agrave; kh nng sn b&agrave;n &aacute;ng gm. Ng&ocirc;i sao Nam M lu&ocirc;n bit c gng tp luyn, thay i, n lc  tr li v&agrave; dp tt mi s nghi ng.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/t-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>14. Kevin de Bruyne: Va qua, ESPN &aacute;nh gi&aacute; De Bruyne l&agrave; tin v c&ocirc;ng xut sc nht l&agrave;ng t&uacute;c cu thi im hin ti. Hin nhi&ecirc;n, m&agrave;n tr&igrave;nh din v&agrave; t&agrave;i nng ca ng&ocirc;i sao ngi B &atilde; c chng minh sut thi gian qua. Nh&atilde;n quan chin thut v&agrave; t duy hn ngi gi&uacute;p tuyn th s 17 tr th&agrave;nh con &aacute;t ch b&agrave;i tr&ecirc;n con ng th&agrave;nh c&ocirc;ng ca Pep v&agrave; Man City.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/m1-0251.jpg\" width=\"630\" /></p>\r\n\r\n<h2>13.&nbsp;N&#39;Golo Kant&eacute;: Kante l&agrave; c&aacute;i t&ecirc;n l&agrave;m ma l&agrave;m gi&oacute; l&agrave;ng t&uacute;c cu sut thi gian qua. Ng&ocirc;i sao ngi Ph&aacute;p tr th&agrave;nh cn &aacute;c mng vi bt c h&agrave;ng tin o n&agrave;o khi anh lu&ocirc;n bit c&aacute;ch khc ch v&agrave; kh&oacute;a cht i phng. Th&agrave;nh c&ocirc;ng ca Les Bleus ti World Cup 2018 n t s cng hin kh&ocirc;ng nh ca tin v s 7.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d1-0250.jpg\" width=\"630\" /></p>\r\n\r\n<h2>12.&nbsp;Sergio Aguero: Aguero ang tr th&agrave;nh c&acirc;y sn b&agrave;n kh&eacute;t ting  Ngoi hng Anh. Tuyn th ngi Argentina li&ecirc;n tc lp k lc khi m&ugrave;a gii 2018/2019 ch va tr&ocirc;i qua c 1/3 chng ng. Hin ti, tin o s 10 &atilde; tr th&agrave;nh 1 phn kh&ocirc;ng th thay th  Man City.</h2>\r\n\r\n<p><img alt=\"Top 30 ngi sao xut sc nht nm 2018 (phn 2): - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/t2-0250.jpg\" width=\"630\" /></p>\r\n\r\n<h2>11. David Silva: &quot;Gng c&agrave;ng gi&agrave; c&agrave;ng cay&quot;, c&acirc;u n&agrave;y ho&agrave;n to&agrave;n &uacute;ng vi trng hp ca David Silva. Ng&ocirc;i sao ngi T&acirc;y Ban Nha  tui 32 vn cho thy c t&agrave;i nng c&ugrave;ng nhng t&igrave;nh hung x l&yacute;, kim so&aacute;t hn ngi. Vic De Bruyne vng mt sut thi gian qua, tin v x b&ograve; t&oacute;t c&agrave;ng c&oacute; t din v&agrave; g&aacute;nh v&aacute;c tuyn gia v&ocirc; c&ugrave;ng xut sc. V tr&iacute; h&ocirc;m nay l&agrave; phn thng xng &aacute;ng cho Silva.</h2>\r\n\r\n<p>Bch Bng | 09:00 22/12/2018</p>\r\n', 'AnhPhapDucYTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(31, 'ducdeptrai', , 'Sancho, Reus gip Dortmund thit lp li khong cch 9 im', 'Jadon Sancho v Marco Reus  to sng trong mt trn cu rt kh khn dnh cho Dortmund.', '<p>Jadon Sancho v&agrave; Marco Reus &atilde; to s&aacute;ng trong mt trn cu rt kh&oacute; khn d&agrave;nh cho Dortmund.</p>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s2-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Dortmund ng &nbsp;Gladbach l&agrave; trn u &aacute;ng ch&uacute; &yacute; nht  v&ograve;ng 17 Bundesliga bi &acirc;y l&agrave; 2 i b&oacute;ng ang chia s ng&ocirc;i u bng.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s1-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Trn cu din ra cc k kch t&iacute;nh ngay t khi ting c&ograve;i khai cuc ca trng t&agrave;i vang l&ecirc;n.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s0-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Ph&uacute;t 34, Dortmund gp tn tht ln khi ch&acirc;n s&uacute;t ang v&agrave;o phom&nbsp;Alcacer d&iacute;nh chn thng nng v&agrave; buc phi ri s&acirc;n nhng ch cho Mario Gotze.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s5-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Ch &iacute;t ph&uacute;t sau khi v&agrave;o s&acirc;n, Gotze &atilde; c&oacute; pha kin to  thn ng nc Anh&nbsp;Jadon Sancho lp c&ocirc;ng m t s cho Dortmund.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s6-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Sancho ang thi u qu&aacute; hay.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s9-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tuy nhi&ecirc;n,&nbsp;3 ph&uacute;t sau Gladbach &atilde; c&oacute; b&agrave;n g ho&agrave; do c&ocirc;ng ca&nbsp;Christoph Kramer.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s10-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Trn u tr v vch xut ph&aacute;t sau khi kt th&uacute;c hip 1.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/3-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Sang hip 2,&nbsp;tin v Gotze ho&agrave;n tt c&uacute; &uacute;p kin to  Marco Reus ghi b&agrave;n, a i nh&agrave; vt l&ecirc;n dn trc 2-1  ph&uacute;t 54.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s4-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Gotze qu thc l&agrave; thn may mn ca Dortmund trn n&agrave;y.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus gip Dortmund thit lp li khong cch 9 im - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s7-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;T s trn u c gi nguy&ecirc;n, Dortmund h Gladbach  cng c ng&ocirc;i v u bng vi 9 im nhiu hn i th v&agrave; Bayern Munich (cha &aacute;).</h2>\r\n\r\n<p><strong>i h&igrave;nh ra s&acirc;n:</strong></p>\r\n\r\n<p><em><strong>Dortmund</strong></em>: B&uuml;rki - Piszczek, Weigl, Toprak, Hakimi - Witsel, Delaney &ndash; Sancho (Wolf 90+2&rsquo;), Reus (c), Guerreiro (Bruun Larsen 90+3&rsquo;) &ndash; Alcacer (G&ouml;tze 34&rsquo;)</p>\r\n\r\n<p><em><strong>M&ouml;nchengladbach</strong></em>: Sommer - Johnson, Beyer, Strobl, Wendt (c) &ndash; Kramer (Hofmann 68&rsquo;), Zakaria, Neuhaus (Cuisance 81&rsquo;) - Hazard, Plea, Herrmann (Traore 73&rsquo;)</p>\r\n\r\n<p><em>Ghi b&agrave;n:</em>&nbsp;1-0 Sancho (42&rsquo;), 1-1 (Kramer 45+1), 2-1 (Reus 54&rsquo;)</p>\r\n\r\n<p><strong>Video tng hp din bin trn u&nbsp;Borussia Dortmund 2-1 Borussia M&ouml;nchengladbach:</strong></p>\r\n', 'AnhDucTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(32, 'ducdeptrai', , 'Lo tng ln ting, Bayern Munich ph hi nng vo gy Dortmund', 'Bayern Munich rt ngn cch bit vi Dortmund, qua  khin cuc ua Bundesliga tr nn hp dn hn bao gi ht.', '<h1><a href=\"http://www.bongda.com.vn/lao-tuong-len-tieng-bayern-munich-pha-hoi-nong-vao-gay-dortmund-d477884.html\">L&atilde;o tng l&ecirc;n ting, Bayern Munich ph hi n&oacute;ng v&agrave;o g&aacute;y Dortmund</a></h1>\r\n\r\n<p>08:28 Th nm 20/12/2018</p>\r\n\r\n<p>BongDa.com.vn&nbsp;Bayern Munich r&uacute;t ngn c&aacute;ch bit vi Dortmund, qua &oacute; khin cuc ua Bundesliga tr n&ecirc;n hp dn hn bao gi ht.</p>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s6-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Bayern Munich&nbsp;bc v&agrave;o trn u gp&nbsp;RB Leipzig vi tin vui khi Dortmund bt ng gc ng&atilde;  v&ograve;ng&nbsp;16 Bundesliga.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s5-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Th nhng Leipzig kh&ocirc;ng phi i th d chu. H li&ecirc;n tc g&acirc;y ra nhiu kh&oacute; khn cho H&ugrave;m x&aacute;m ngay ti th&aacute;nh a Allianz Arena.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s3-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Bayern Munich gp b tc trong vic tip cn khung th&agrave;nh i phng sau gn 1 ting ri ng h thi u.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s4-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Phi ti ph&uacute;t 83, Bayern Munich mi c&oacute; c nim vui khi l&atilde;o tng Franck&nbsp;Ribery c&oacute; c&uacute; dt im th&agrave;nh c&ocirc;ng trong v&ograve;ng cm.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s7-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;B&agrave;n thng y trn u tr n&ecirc;n kch t&iacute;nh  nhng ph&uacute;t cui. Ph&uacute;t 90+1,&nbsp;Leipzig ch c&ograve;n thi u vi 10 ngi bi&nbsp; Ilsanker phi nhn th  ri s&acirc;n.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s1-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Tip theo sau &oacute;, ti lt&nbsp;Renato Sanches cng b trng t&agrave;i trut quyn thi u.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s2-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;D&ugrave; vy, Bayern Munich vn bo to&agrave;n c t s 1-0, qua &oacute; gi&agrave;nh c 3 im cc k quan trng.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s8-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Vi kt qu n&agrave;y,&nbsp;Bayern Munich ng th 3 tr&ecirc;n bng xp hng nhng &atilde; thu ngn c&aacute;ch bit vi Dortmund xung c&ograve;n 6 im.</h2>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s9-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Dortmund tht bi vi t s 1-2 trc&nbsp;Dusseldorf m ra c hi b&aacute;m ui cho Bayern Munich khi c&aacute;ch bit hin gi ch c&ograve;n l&agrave; 6 im m&agrave; m&agrave; gii vn c&ograve;n kh&aacute; d&agrave;i.</h2>\r\n', 'DucC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(33, 'ducdeptrai', , 'Bo v ng i, Ronaldo ci nhau tay i vi trng ti', 'Siu sao B o Nha t ra v cng khng hi lng vi ngi iu khin trn u  tnh hung i nh chu thit.', '<h1><a href=\"http://www.bongda.com.vn/bao-ve-dong-doi-ronaldo-cai-nhau-tay-doi-voi-trong-tai-d479091.html\">Bo v ng i, Ronaldo c&atilde;i nhau tay &ocirc;i vi trng t&agrave;i</a></h1>\r\n\r\n<p>21:31 Th by 29/12/2018</p>\r\n\r\n<p>BongDa.com.vn&nbsp;Si&ecirc;u sao B &agrave;o Nha t ra v&ocirc; c&ugrave;ng kh&ocirc;ng h&agrave;i l&ograve;ng vi ngi iu khin trn u  t&igrave;nh hung i nh&agrave; chu thit.</p>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/y-2059.jpg\" width=\"629\" /></p>\r\n\r\n<h2>&nbsp;Trong khu&ocirc;n kh V&ograve;ng 19 Serie A, Juventus tip &oacute;n Sampdoria tr&ecirc;n s&acirc;n nh&agrave; Allianz.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/h-2118.jpg\" width=\"618\" /></p>\r\n\r\n<h2>&nbsp;Bianconeri ch&agrave;o &oacute;n s tr li ca Cristiano Ronaldo, tr ct c HLV Max Allegri cho ngh dng sc v&agrave; ch v&agrave;o s&acirc;n t bng gh d b  m&agrave;n chm tr&aacute;n Atalanta c&aacute;ch &acirc;y &iacute;t ng&agrave;y.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/4-2107.jpg\" width=\"865\" /></p>\r\n\r\n<h2>&nbsp;Khi c&aacute;c kh&aacute;n gi c&ograve;n cha m ch, CR7 &atilde; l&ecirc;n ting. Ph&uacute;t th 2, tn dng ng pht b&oacute;ng gia s&acirc;n ch&iacute;nh x&aacute;c ca Paulo Dybala, Ronaldo x l&yacute; chp nho&aacute;ng v&agrave; kt th&uacute;c ho&agrave;n ho bng c&uacute; s&uacute;t ch&igrave;m p t tung li Sampdoria, m t s trn u.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/f-2108.jpg\" width=\"625\" /></p>\r\n\r\n<h2>&nbsp;Sau b&agrave;n thng, Juve kim so&aacute;t b&oacute;ng nhiu nhng kh&ocirc;ng my hiu qu. Ph&uacute;t 29, i kh&aacute;ch bt ng c hng pht n v&igrave; Emre Can  b&oacute;ng chm tay trong v&ograve;ng cm. Tr&ecirc;n chm 11 m&eacute;t,&nbsp;Fabio Quagliarella lnh l&ugrave;ng h gc&nbsp;Mattia Perin san bng c&aacute;ch bit.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/t-2109.jpg\" width=\"617\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo ct lc phn i quyt nh ca trng t&agrave;i&nbsp;Paolo Valeri, do anh cho rng Can kh&ocirc;ng h c &yacute; trong t&igrave;nh hung bay ngi ph&ograve;ng ng.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/g-2109.jpg\" width=\"617\" /></p>\r\n\r\n<h2>&nbsp;Cui hip mt, Paulo Dybala i b&oacute;ng v&agrave; dt im kh&eacute;o l&eacute;o, nhng b th m&ocirc;n&nbsp;Emil Audero  ngi ngn chn.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/s-2109.jpg\" width=\"876\" /></p>\r\n\r\n<h2>&nbsp;u hip hai, Blaise Matuidi v&agrave; Matuidi li&ecirc;n tip tung ra 2 c&uacute; s&uacute;t xa nguy him, nhng u b&nbsp;Audero phn x xut thn cn ph&aacute;.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/ff-2112.jpg\" width=\"618\" /></p>\r\n\r\n<h2>&nbsp;Sc &eacute;p khng khip Juve to ra cui c&ugrave;ng &atilde; khin Sampdoria mc sai lm. Ph&uacute;t 62, n lt i ch nh&agrave; c hng pht n v&igrave;&nbsp;Alex Ferrari  b&oacute;ng chm tay trong v&ograve;ng cm. Tr&ecirc;n chm lu&acirc;n lu, Ronaldo s&uacute;t thng v&agrave;o gia khung th&agrave;nh, &aacute;nh la hng ph&aacute;n o&aacute;n ca Audero t&aacute;i lp th dn trc.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/a-2111.jpg\" width=\"621\" /></p>\r\n\r\n<h2>&nbsp;Knh t&iacute;nh tng cao  nhng ph&uacute;t cui trn, khi&nbsp;Riccardo Saponara v&agrave;o thay ngi l&agrave;m c cu trng Allianz c&acirc;m lng bng c&uacute; ca l&ograve;ng tung li&nbsp;Perin.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/cats-2115.jpg\" width=\"619\" /></p>\r\n\r\n<h2>&nbsp;Tuy th sau khi tham kho bng h&igrave;nh VAR, trng t&agrave;i&nbsp;Valeri li kh&ocirc;ng c&ocirc;ng nhn b&agrave;n thng.</h2>\r\n\r\n<p><img alt=\"NH ST - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/kk-2116.jpg\" width=\"615\" /></p>\r\n\r\n<h2>&nbsp;Gi vng t s 2-1, Juve kt th&uacute;c lt i Serie A vi th&agrave;nh t&iacute;ch bt bi c&ugrave;ng ng&ocirc;i u vng chc.</h2>\r\n', 'PhapYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(34, 'hoduc17', , 'Ronaldo bng n lp c p, Juventus khp li na u ma gii hon ho', 'Vi im ta Allianz, Bianconeri chnh thc ng li giai on lt i bng thnh tch bt bi.', '<p>Tip &oacute;n Sampdoria trong khu&ocirc;n kh lt trn cui lt i Serie A, Juventus &oacute;n ch&agrave;o s tr li ca Cristiano Ronaldo trong i h&igrave;nh xut ph&aacute;t. Kh&ocirc;ng mt qu&aacute; nhiu thi gian&nbsp;<a href=\"http://www.bongda.com.vn/thach-messi-den-serie-a-khon-nhu-ronaldo-d478948.html\" target=\"_blank\"> CR7 to ra du n</a>.</p>\r\n\r\n<p>Ngay ph&uacute;t th 2, Paulo Dybala thc hin ng pht b&oacute;ng iu ngh t gia s&acirc;n, t&igrave;m n ch&iacute;nh x&aacute;c v tr&iacute; Ronaldo trc r&igrave;a v&ograve;ng cm i kh&aacute;ch. Nhn thy&nbsp;Jacopo Sala kh&ocirc;ng c&oacute; &yacute; &aacute;p s&aacute;t, CR7 lp tc y b&oacute;ng v&agrave; tung c&uacute; s&uacute;t ch&igrave;m quyt o&aacute;n nhm v g&oacute;c xa khung th&agrave;nh Sampdoria. B&oacute;ng i p t kh&oacute; chu l&agrave;m b&oacute; tay th th&agrave;nh&nbsp;Emil Audero.&nbsp;</p>\r\n\r\n<p><img alt=\"st - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/dvlpuccx4aezgwv-2016.jpg\" width=\"1200\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo m t s.</h2>\r\n\r\n<p>C&oacute; li th sm, Juve tip tc duy tr&igrave; quyn kim so&aacute;t, nhng c&oacute; phn b tc trc s &ocirc;ng cu th Sampdoria l&ugrave;i s&acirc;u v phn s&acirc;n nh&agrave;. Gi b&oacute;ng nhiu m&agrave; kh&ocirc;ng to ra t bin, Bianconeri phi tr gi&aacute;.</p>\r\n\r\n<p>Ph&uacute;t 29, xut ph&aacute;t t qu pht g&oacute;c ph&iacute;a&nbsp;<a href=\"http://www.bongda.com.vn/sampdoria-search/\" target=\"_blank\">I Blucerchiati</a>, b&oacute;ng chm ngi Emre Can i hng nhm thng v khung th&agrave;nh Juve. Alex Sandro kp thi ph&aacute; b&oacute;ng tr&ecirc;n vch v&ocirc;i nhng sau khi tham kho bng h&igrave;nh VAR,&nbsp;trng t&agrave;i Paolo Valeri cho rng Can &atilde;  b&oacute;ng chm tay v&agrave; cho Sampdoria hng pht n. Tr&ecirc;n chm 11 m&eacute;t,&nbsp;Fabio Quagliarella lnh l&ugrave;ng s&uacute;t thng v&agrave;o gia khung th&agrave;nh, &aacute;nh la hng ph&aacute;n o&aacute;n ca&nbsp;Mattia Perin san bng c&aacute;ch bit.</p>\r\n\r\n<p>Cui hip mt, Juve to ra mt s t&igrave;nh hung &aacute;ng ch&uacute; &yacute;, nhng c c&uacute; s&uacute;t xa ca Dybala ln qu &aacute;nh u t i trng Giorgio Chiellini u kh&ocirc;ng mang v b&agrave;n thng.&nbsp;<strong>2 i&nbsp;bc v&agrave;o gi ngh&nbsp;vi kt qu 1-1.&nbsp;</strong></p>\r\n\r\n<p>Sang hip hai, Juve y cao i h&igrave;nh dn &eacute;p i phng. Ph&uacute;t 52, Blaise Matuidi &oacute;n b&oacute;ng bt ra v&agrave; tung ch&acirc;n tc . Tic&nbsp;cho tuyn th Ph&aacute;p, th m&ocirc;n Audero &atilde; phn x xut thn t chi. 7 ph&uacute;t sau, li l&agrave; nhng u ng&oacute;n tay ca&nbsp;Audero a b&oacute;ng di khung g, gii nguy cho Sampdoria sau c&uacute; n&atilde; i b&aacute;c ca Ronaldo.</p>\r\n\r\n<p>N lc kh&ocirc;ng ngng ngh ca i ch nh&agrave; cui c&ugrave;ng cng c n &aacute;p  ph&uacute;t 62. T pha pht g&oacute;c ph&iacute;a Juve, Alex Ferrari l&oacute;ng ng&oacute;ng  tay chm b&oacute;ng khin i kh&aacute;ch b thi pht n. Tng t&nbsp;Quagliarella,&nbsp;<strong>Ronaldo quyt nh s&uacute;t v&agrave;o gia khung th&agrave;nh khi ng trc chm lu&acirc;n lu.</strong>&nbsp;Audero bay sang tr&aacute;i v&agrave; kh&ocirc;ng th l&agrave;m g&igrave; hn ngo&agrave;i v&agrave;o li nht b&oacute;ng.&nbsp;</p>\r\n\r\n<p><img alt=\"st - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/5-2018.jpg\" width=\"621\" /></p>\r\n\r\n<h2>&nbsp;Vn l&agrave; Ronaldo nh ot kt cc trn u.</h2>\r\n\r\n<p>T&aacute;i lp th dn trc,&nbsp;<a href=\"http://www.bongda.com.vn/juventus-search/\" target=\"_blank\">Juve</a>&nbsp;ch ng chi chm gi th trn. Sampdoria d&ugrave; gng sc v&ugrave;ng l&ecirc;n nhng li qu&aacute; thiu &yacute; tng tip cn khung th&agrave;nh i ch nh&agrave;. Nhng tng trn u &atilde; an b&agrave;i th&igrave; bt ng  ph&uacute;t 90+2, cu th v&agrave;o s&acirc;n thay ngi&nbsp;Riccardo Saponara bt ng&nbsp;ca l&ograve;ng him h&oacute;c khin Perin ch&ocirc;n ch&acirc;n nh&igrave;n b&oacute;ng bay v&agrave;o li. Tuy vy, sau khi th&ecirc;m 1 ln d&ugrave;ng n c&ocirc;ng ngh VAR, trng t&agrave;i&nbsp;Valeri nhn nh s 5 Sampdoria &atilde; ri v&agrave;o th vit v trc &oacute; v&agrave; b&agrave;n g h&ograve;a kh&ocirc;ng c c&ocirc;ng nhn.</p>\r\n\r\n<p>B t&uacute;i 3 im, Juve kh&eacute;p li nm 2018 vi th&agrave;nh t&iacute;ch bt bi  na u m&ugrave;a gii Serie A.</p>\r\n\r\n<p><strong>Chung cuc:&nbsp;</strong>Juventus 2-1 Sampdoria</p>\r\n\r\n<p><strong>Ghi b&agrave;n:</strong>&nbsp;Juventus:&nbsp;Cristiano Ronaldo&nbsp;2&#39;, 65&#39;. Sampdoria: Fabio Quagliarella 33&#39;.</p>\r\n\r\n<p><strong>i h&igrave;nh ra s&acirc;n</strong></p>\r\n\r\n<p><img alt=\"st - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/cats-1850.jpg\" width=\"896\" /></p>\r\n\r\n<p>Phng S | 18:30 29/12/2018</p>\r\n', 'YTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(35, 'hoduc17', , 'Ronaldo tit l k vng nu chm trn Real Madrid', 'Tr li t Record  qu nh B o Nha, Cristiano Ronaldo cho bit anh vn cn rt nhiu tnh cm vi CLB c Real Madrid.', '<p>Tr li t Record  qu&ecirc; nh&agrave; B &agrave;o Nha, Cristiano Ronaldo cho bit anh vn c&ograve;n rt nhiu t&igrave;nh cm vi CLB c Real Madrid.</p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/Cristiano+Ronaldo-search/\" target=\"_blank\">Cristiano Ronaldo</a>&nbsp;tha nhn mun nhng ngi h&acirc;m m&nbsp;Real Madrid&nbsp;&oacute;n ch&agrave;o trong trng hp anh tr li.<em>&nbsp;&quot;Santiago Bernabeu l&agrave; nh&agrave; ca t&ocirc;i trong nhiu nm v&agrave; s lu&ocirc;n lu&ocirc;n l&agrave; s&acirc;n vn ng rt c bit. T&ocirc;i lu&ocirc;n c&oacute; t&igrave;nh cm vi&nbsp;<a href=\"http://www.bongda.com.vn/Real+Madrid-search/\" target=\"_blank\">Real Madrid</a>&nbsp;cng nh nhng ngi h&acirc;m m v&agrave;<strong>mun m&igrave;nh s c &oacute;n ch&agrave;o nu tr li</strong>&quot;.</em></p>\r\n\r\n<p>Ronaldo cng tit l khonh khc c tr li Old Trafford i u vi Man United l&agrave; &quot;tri nghim c bit&quot; vi bn th&acirc;n.&nbsp;<em>&quot;Manchester ? &oacute; l&agrave; ng&agrave;y tr li tuyt vi. Nhng CV MU lu&ocirc;n &oacute;n ch&agrave;o t&ocirc;i nh khi t&ocirc;i c&ograve;n thi u ti Old Trafford vy&quot;</em>, Ronaldo n&oacute;i.</p>\r\n\r\n<p><img alt=\" - Bng \" src=\"http://media.bongda.com.vn/files/bao.nguyen/2019/01/03/ronaldo-1021.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo &atilde; c&ugrave;ng Real Madrid gi&agrave;nh 4 chc v&ocirc; ch Champions League. nh:&nbsp;Getty Images.</h2>\r\n\r\n<p>Ronaldo &atilde; ri Real Madrid v&agrave;o m&ugrave;a h&egrave; 2018 vi gi&aacute; 100 triu euro  chuyn ti Juventus. Trong m&agrave;u &aacute;o mi, Ronaldo ngay lp tc ta s&aacute;ng vi 15 b&agrave;n tr&ecirc;n mi mt trn  tr th&agrave;nh ch&acirc;n s&uacute;t ghi nhiu b&agrave;n th 2 cho Juve trong nm 2018, ch sau Paulo Dybala.</p>\r\n\r\n<p>Ti Serie A ch sau 4 th&aacute;ng, Ronaldo c&oacute; 14 b&agrave;n sau 19 trn v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/thoi-dinh-cao-ro-beo-cung-khong-khoi-dau-tot-bang-ronaldo-o-serie-a-d479332.html\" target=\"_blank\">tr th&agrave;nh &quot;t&acirc;n binh&quot; hay bc nht trong lch s gii u cao nht Italy</a>, vt qua c nhng t&ecirc;n tui nh &quot;Ngi ngo&agrave;i h&agrave;nh tinh&quot; Ronaldo, Andriy Shevchenko hay Diego Maradona.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:08</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:02</p>\r\n\r\n<p>Trong khi &oacute;, Real Madrid lao ao sau khi CR7 ri i khi thua Barcelona 1-5 trong trn El Clasico lt i v&agrave; phi sa thi HLV Julen Lopetegui. Hin Real ch ng th 4 tr&ecirc;n bng xp hng La Liga, k&eacute;m Barca 4 im. Nm 2018, Ronaldo vn l&agrave; ch&acirc;n s&uacute;t s mt ca Real vi 28 b&agrave;n d&ugrave; anh &atilde; ri i t th&aacute;ng 7.</p>\r\n\r\n<p>Ronaldo trong m&agrave;u &aacute;o mi Juventus &atilde; tr li Old Trafford i u MU ti v&ograve;ng bng Champions League m&ugrave;a n&agrave;y. CR7 kh&ocirc;ng ghi b&agrave;n nhng chi n tng v&agrave; &oacute;ng g&oacute;p quan trng v&agrave;o b&agrave;n thng duy nht ca trn u do c&ocirc;ng ca Paulo Dybala.</p>\r\n', 'YTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(36, 'ducdeptrai', , 'Vo chung kt Coppa Italia, Gattuso khen Montella nc n', 'Sau khi nh bi Lazio ti bn kt lt v Coppa Italia, HLV Gennaro Gattuso  gi li cm n n HLV c ca AC Milan, Vincenzo Montella.', '<p><a href=\"http://www.bongda.com.vn/AC+Milan-search/\" target=\"_blank\">AC Milan</a>&nbsp;tip tc cho thy sc mnh ca h di thi ca HLV&nbsp;<a href=\"http://www.bongda.com.vn/Gennaro+Gattuso-search/\" target=\"_blank\">Gennaro Gattuso</a>&nbsp;bng chin thng ti b&aacute;n kt Coppa Italia trc Lazio. Qua &oacute; h gi&agrave;nh v&eacute; v&agrave;o chi chung kt vi Juventus. Ph&aacute;t biu sau trn u, ng&agrave;i Rino vn t ra kh&aacute; khim tn v&agrave; d&agrave;nh li cm n n HLV c l&agrave;&nbsp;Vincenzo Montella.</p>\r\n\r\n<p><img alt=\"Vo chung kt Coppa Italia, Gattuso khen Montella nc n - Bng \" src=\"http://media.bongda.com.vn/files/trang.nguyen/2018/03/01/000822534-e27fdd17-38f4-452e-8153-f3fb504ecfc0-0850.jpg\" width=\"810\" /></p>\r\n\r\n<h2>&nbsp;Gattuso t ra khim tn.</h2>\r\n\r\n<p>Rino ph&aacute;t biu: &quot;<em>Lazio l&agrave; mt i b&oacute;ng rt mnh. Ch&uacute;ng t&ocirc;i &atilde; c&oacute; mt trn cu cng thng nhng cng c&oacute; nhng sai lm trong vic to ra qu&aacute; nhiu khong trng cho Immobile. L ra Milan &atilde; c&oacute; b&agrave;n thng trong thi gian thi u ch&iacute;nh thc.</em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/buffon-toa-sang-juve-chiem-loi-the-lon-tai-coppa-italia-d433220.html\">Buffon ta s&aacute;ng, Juve chim li th ln ti Coppa Italia</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/allegri-toi-khong-muon-noi-them-gi-nua-d429511.html\">Allegri: &quot;T&ocirc;i kh&ocirc;ng mun n&oacute;i th&ecirc;m g&igrave; na!&quot;</a></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p><em>S d tp th c&oacute; c ng&agrave;y h&ocirc;m nay l&agrave; nh c&aacute;c cu th &atilde; c gng v&agrave; mt phn c&ocirc;ng lao to ln ca&nbsp;Montella. &Ocirc;ng y &atilde; c&oacute; c&ocirc;ng gn kt c&aacute;c cu th li vi nhau t trc &oacute;.&quot;</em></p>\r\n\r\n<p>Sau khi c&aacute;m n HLV c, Gattuso th hin quyt t&acirc;m ca m&igrave;nh vi AC Milan. &quot;<em>Ch&uacute;ng t&ocirc;i s c&ograve;n nhng trn u quan trng ph&iacute;a trc v&agrave; ch&uacute;ng t&ocirc;i s tip tc l&agrave;m tt cho n th&aacute;ng 6. T&ocirc;i tin m&igrave;nh kh&ocirc;ng phi l&agrave; HLV s  cnh Milan cho n cui c&ugrave;ng, nhng&nbsp;<strong>cho n hin nay t&ocirc;i l&agrave; mt ngi &atilde; rt may mn ri</strong>.&quot;</em></p>\r\n\r\n<p>Ti trn b&aacute;n kt lt v ti khu&ocirc;n kh Coppa Italia, sau khi chng th ghi c b&agrave;n thng n&agrave;o trong 120 ph&uacute;t tranh t&agrave;i, AC Milan v&agrave; Lazio &atilde; phi nh n lot s&uacute;t lu&acirc;n lu  ph&acirc;n nh thng thua.&nbsp;Alessio Romagnoli l&agrave; ngi thc hin t&igrave;nh hung s&uacute;t pht quyt nh  mang v chin thng 5-4 y nght th d&agrave;nh cho AC Milan.</p>\r\n\r\n<p><strong>i th ca Rossoneri trong trn u cui c&ugrave;ng s l&agrave; Juventus</strong>, i b&oacute;ng &atilde; vt qua Atalanta vi tng t s 2-0.</p>\r\n\r\n<p>Trang &Yacute; - BongDa.com.vn - TTVN | 08:55 01/03/2018</p>\r\n', 'PhapYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(37, 'ducdeptrai', , 'Ronaldo ni li thng thn v VAR sau khi lp c p cho Juventus', 'Tin o Cristiano Ronaldo ln ting sau chin thng ca Juventus trc Sampdoria.', '<p>Va qua,&nbsp;<a href=\"http://www.bongda.com.vn/Juventus-search/\" target=\"_blank\">Juventus</a>&nbsp;&atilde; ch&iacute;nh thc kh&eacute;p li giai on lt i Serie A mt c&aacute;ch ho&agrave;n ho vi chin thng 2-1 trc Sampdoria. Ng&ocirc;i sao s&aacute;ng nht nh thng l vn l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Cristiano+Ronaldo-search/\" target=\"_blank\">Cristiano Ronaldo</a>&nbsp;vi mt c&uacute; penalty th&agrave;nh c&ocirc;ng c&ugrave;ng mt pha ra ch&acirc;n thn su  ngay ph&uacute;t th hai ca trn u. Vi c&uacute; &uacute;p n&agrave;y, s 7 &atilde; vt qua Rui Barros  tr th&agrave;nh cu th ngi B &agrave;o Nha ghi&nbsp;<a href=\"http://www.bongda.com.vn/ha-sat-sampdoria-ronaldo-lai-them-mot-lan-di-vao-lich-su-d479111.html\" target=\"_blank\">nhiu b&agrave;n thng nht</a>&nbsp;ti Serie A trong mt m&ugrave;a gii.</p>\r\n\r\n<p>Th nhng c&ograve;n mt im nhn kh&aacute;c &aacute;ng ch&uacute; &yacute; kh&ocirc;ng k&eacute;m, &oacute; l&agrave; vic tin v&nbsp;Riccardo Saponara b&ecirc;n ph&iacute;a c&aacute;c v kh&aacute;ch cng su&yacute;t ch&uacute;t na c&oacute; th in t&ecirc;n l&ecirc;n bng t s nu kh&ocirc;ng c&oacute; s xut hin ca c&ocirc;ng ngh VAR. N&oacute;i v iu n&agrave;y, Cristiano chia s:</p>\r\n\r\n<p><img alt=\"Ronaldo comments on VAR after controversial Juve win vs. Samp - Bng \" src=\"http://media.bongda.com.vn/files/tu.dao/2018/12/29/dc-cover-tsphaeasihnii622qdm3ognt46-20181109124905medi-2253.jpeg\" width=\"1000\" /></p>\r\n\r\n<h2>Ronaldo l&agrave; cu th hay nht trn u gia Juventus v&agrave; Sampdoria.</h2>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i &atilde; l&agrave;m rt tt, kh&ocirc;ng ch trong trn u n&agrave;y m&agrave; l&agrave; t u m&ugrave;a gii ti gi. Gn nh mi trn u u kt th&uacute;c vi mt thng li cho Juventus. Th nhng m&ugrave;a gii c&ograve;n rt d&agrave;i, v&igrave; th ch&uacute;ng t&ocirc;i vn cn tip tc duy tr&igrave; s tp trung.&quot;</em></p>\r\n\r\n<p><em><strong>&quot;C&ograve;n VAR ? T&ocirc;i th&iacute;ch c&ocirc;ng ngh n&agrave;y bi n&oacute; hn ch vic c&aacute;c trng t&agrave;i mc sai lm.</strong>&nbsp;Th nhng d&ugrave; th n&agrave;o, c&ocirc;ng vic ca c&aacute;c trng t&agrave;i cng l&agrave; rt kh&oacute; khn v&agrave; ch&uacute;ng ta n&ecirc;n to iu kin tt nht  h l&agrave;m nhim v ca m&igrave;nh.&quot;</em></p>\r\n', 'DucYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(38, 'ducdeptrai', , 'Ronaldo bng n lp c p, Juventus khp li na u ma gii hon ho', 'Vi im ta Allianz, Bianconeri chnh thc ng li giai on lt i bng thnh tch bt bi.', '', 'YTBNC1CN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(39, 'hoduc17', , 'Man Utd c ng thi c th v tin o 40 triu euro ngi Nht Bn', 'Rt nhiu i bng Anh ang  mt n tin o ngi Nht Bn, Shoya Nakajima.', '<p>Shoya Nakajima nm nay 24 tui, ang thi u cho CLB Portimonense  B &agrave;o Nha. Nakajima c&oacute; v tr&iacute; s trng l&agrave; tin o tr&aacute;i, nhng khi cn, anh c&oacute; th chi tt  c&aacute;nh phi. Ng&ocirc;i sao ngi Nht Bn c&oacute; kh nng to t bin tt qua nhng ng chuyn, nhng pha i b&oacute;ng v&agrave;o trung l hay dt im t xa li hi.</p>\r\n\r\n<p><img alt=\"Man Utd theo di Nakajima  - Bng \" src=\"http://media.bongda.com.vn/files/thach.pham/2019/01/04/shoyanakajima-1-0609.jpg\" width=\"700\" /></p>\r\n\r\n<h2>&nbsp;Shoya Nakajima c Man Utd quan t&acirc;m.</h2>\r\n\r\n<p>Sau 13 trn  gii VQG B &agrave;o Nha, Nakajima &atilde; ghi c 5 b&agrave;n thng, cung cp 5 ng kin to v&agrave; c&oacute; n 3 ln c b&igrave;nh chn l&agrave; Cu th xut sc nht trn. Trang WhoScored chm im trung b&igrave;nh ca Nakajima l&ecirc;n n 7.25.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hin ti, Nakajima ang lt v&agrave;o tm ngm ca nhiu i b&oacute;ng ln  Anh, nh Wolves, Leicester City, Chelsea. Mi nht, Man Utd &atilde; ph&aacute;i c&aacute;c tuyn trch vi&ecirc;n ca m&igrave;nh trc tip &#39;xem gi&ograve;&#39; Nakajima trong trn u ca Portimonense vi Benfica h&ocirc;m th T.</p>\r\n\r\n<p>Nakajima c&oacute; iu khon gii ph&oacute;ng hp ng vi Portimonense l&ecirc;n n 40 triu euro. Bi vy, s kh&ocirc;ng d  c&aacute;c i b&oacute;ng Anh a cu th tn c&ocirc;ng ngi Nht Bn v x Sng m&ugrave;.</p>\r\n\r\n<p><strong>T&agrave;i nng c bit ca Shoya Nakajima:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Minh Tun | 05:14 04/01/2019</p>\r\n', 'AnhYCN', 0),
(40, 'hoduc17', , 'Messi ch ra 5 ci tn Barcelona nn mua', 'Theo Don Balon, Lionel Messi   xut vi Barcelona 5 ci tn anh tin rng cn c quan tm trn TTCN ln ny.', '<p>C th 5 c&aacute;i t&ecirc;n c Messi  cp n &oacute; l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Adrien+Rabiot-search/\" target=\"_blank\">Adrien Rabiot</a>,&nbsp;<a href=\"http://www.bongda.com.vn/Matthijs+De+Ligt-search/\" target=\"_blank\">Matthijs de Ligt</a>, Benjamin Pavard,&nbsp;<a href=\"http://www.bongda.com.vn/Frenkie+de+Jong-search/\" target=\"_blank\">Frenkie De Jong</a>&nbsp;v&agrave; Krzysztof Pitek.</p>\r\n\r\n<p><img alt=\"Messi ch ra 5 ci tn Barcelona nn mua - Bng \" src=\"http://media.bongda.com.vn/files/anh.vu/2019/01/03/3a1-2115.jpg\" width=\"594\" /></p>\r\n\r\n<h2>&nbsp;Messi &atilde;  xut cho Barcelona 5 c&aacute;i t&ecirc;n n&ecirc;n mua.</h2>\r\n\r\n<p>Trong s n&agrave;y, Frenkie De Jong l&agrave; cu th &atilde; c truyn th&ocirc;ng nhc n kh&aacute; nhiu trong thi gian qua nh mt ng&ocirc;i sao c&oacute; kh nng cp bn Barcelona trong tng lai l&agrave; rt cao. Bn th&acirc;n gia &igrave;nh ca De Jong cng &atilde; c&oacute; nhng ph&aacute;t biu nh hng tin v 21 tui n&agrave;y n vi s&acirc;n Nou Camp thi u.</p>\r\n\r\n<p>Ngi ng i ca De Jong ti Ajax l&agrave; Matthijs de Ligt cng l&agrave; mt trung v &atilde; c Barcelona theo ui rt l&acirc;u. Tuy nhi&ecirc;n cu b&eacute; v&agrave;ng 2018 v&agrave;o thi im n&agrave;y vn ang rt lng l v tng lai, khi anh ang nhn c nhng li mi gi hp dn kh&ocirc;ng k&eacute;m t Anh v&agrave; Italia.</p>\r\n\r\n<p>Trong khi &oacute; Adrien Rabiot l&agrave; cu th m&agrave; Barcelona d d&agrave;ng tip cn nht, khi hp ng gia anh v&agrave; PSG s ht hn v&agrave;o cui m&ugrave;a gii nm nay, trong khi c 2 b&ecirc;n dng nh kh&ocirc;ng h c&oacute; &yacute; nh ngi li &agrave;m ph&aacute;n trong thi gian ti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:04</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:00</p>\r\n\r\n<p>Krzysztof Pitek l&agrave; mt hin tng ang ni l&ecirc;n ti Serie A v&agrave; &acirc;y s l&agrave; mt s b sung kh&ocirc;ng ti cho h&agrave;ng c&ocirc;ng. C&ograve;n Benjamin Pavard l&agrave; c&aacute;i t&ecirc;n duy nht trong 5 ngi k tr&ecirc;n cha tng c truyn th&ocirc;ng nhc ti nh mc ti&ecirc;u ca Barcelona.</p>\r\n\r\n<p><em><strong>Video t&agrave;i nng ca Frenkie De Jong</strong></em></p>\r\n', 'YTBNCN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(41, 'dung29', , 'Sao Chelsea t tha thun vi Monaco, s tht sc lin quan n Pogba, MU v Barca', 'Cesc Fabregas  lin h xong v sp gia nhp Monaco.', '<p>Phi&ecirc;n ch &ocirc;ng ang din ra v&ocirc; c&ugrave;ng n&aacute;o nhit nhng cng rt cng thng. C&aacute;c CLB u l&ecirc;n sn k hoch v&agrave; tranh ua quyt lit  ho&agrave;n tt c&aacute;c bn hp ng cht lng. Kh&oacute;  bom tn &igrave;nh &aacute;m c k&iacute;ch n, song ha hn s c&oacute; nhiu thng v t gi&aacute;.</p>\r\n\r\n<p><img alt=\"Sao Chelsea t tha thun vi Monaco,  - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/cescfabregas1409abc-1534.jpg\" width=\"968\" /></p>\r\n\r\n<h2>Cesc sp ri Chelsea.</h2>\r\n\r\n<p>Va qua,&nbsp;<a href=\"http://www.bongda.com.vn/soc-sarri-thua-nhan-chang-biet-gi-ve-viec-chelsea-mua-pulisic-d479647.html\" target=\"_blank\">Chelsea va ch&iacute;nh thc chi&ecirc;u m th&agrave;nh c&ocirc;ng cu th chy c&aacute;nh Christian Pulisic&nbsp;</a>vi gi&aacute; cao ngt ngng, 64 triu euro. V&agrave;&nbsp;TTCN mt phen nh&aacute;o nh&agrave;o v&igrave; kh&ocirc;ng &iacute;t c ng vi&ecirc;n bt ng. Th nhng, cha dng li  &oacute; khi song song The Blues sp chia tay ng&ocirc;i sao&nbsp;Cesc Fabregas.</p>\r\n\r\n<p>Thi gian qua, b&aacute;o ch&iacute; quc t ng ti kh&ocirc;ng &iacute;t th&ocirc;ng tin li&ecirc;n quan n vic tuyn th ngi T&acirc;y Ban Nha ri Stamford Bridge v&agrave; CLB anh cp bn l&agrave; AS Monaco. Mi &acirc;y, t L&#39;Equipe tip tc cp nht v thng v tr&ecirc;n. Theo &oacute;, ph&iacute;a i b&oacute;ng nc Ph&aacute;p &atilde; li&ecirc;n lc xong vi tin v 31 tui. Kh&ocirc;ng nhng vy,&nbsp;<strong>i din Ligue 1 v&agrave; Cesc cng &atilde; t tha thun s b.&nbsp;</strong></p>\r\n\r\n<p>Hin ti, ng&ocirc;i sao x b&ograve; t&oacute;t vn c&ograve;n hp ng 6 th&aacute;ng vi&nbsp;<a href=\"http://www.bongda.com.vn/chelsea-search/\" target=\"_blank\">Chelsea</a>. Du vy, Ban l&atilde;nh o Monaco vn mun chun b cam kt mi cho tuyn th s 4. Fabregas s gn b&oacute; vi s&acirc;n&nbsp;Louis II trong v&ograve;ng 2 nm ri v&agrave; tin lng khong 10 triu euro/nm.  &acirc;y, tin v 31 tui s c&oacute; c hi l&agrave; vic vi ngi &agrave;n anh cng l&agrave; ng i c, HLV&nbsp;Thierry Henry.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:07</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:00</p>\r\n\r\n<p><img alt=\"Sao Chelsea t tha thun vi Monaco,  - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/skysports-paul-pogba-manchester-united_4533670-1534.jpg\" width=\"768\" /></p>\r\n\r\n<h2>Pogba l&agrave; con cng ca MU.</h2>\r\n\r\n<p>Cng tr&ecirc;n t Ph&aacute;p,  Paris, tng lai Rabiot vn cha c quyt nh. Trc &oacute;, theo Sport.es,&nbsp;trong tun n&agrave;y, ng&ocirc;i sao 23 tui s k&yacute; hp ng vi Barcelona. Tuyn th ngi Ph&aacute;p s gia nhp i ch s&acirc;n Camp Nou bng mt bn hp ng k&eacute;o d&agrave;i 5 nm vi mc lng v&agrave;o khong 10 triu euro/m&ugrave;a. Song, hin ti, t Mundo Deportivo cho hay, m tuyn th s 25 cha la chn xong bn  v&agrave; anh tip tc li&ecirc;n h vi nhiu CLB kh&aacute;c nhau.</p>\r\n\r\n<p> mt din bin kh&aacute;c, truyn th&ocirc;ng T&acirc;y Ban Nha va tit l s tht kh&ocirc;ng nh li&ecirc;n quan n thng v Pogba, Barca v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/manchester+united-search/\" target=\"_blank\">Manchester United</a>. C th, theo Mundo Deportivo, l&yacute; do khin i din Catalan tht bi trong vic chi&ecirc;u m si&ecirc;u sao ngi Ph&aacute;p kh&ocirc;ng nm  tin bc.</p>\r\n\r\n<p>Thi im &oacute;, bom tn 25 tui tht s ch&aacute;n cnh  Old Trafford v&igrave; Mourinho. Anh &atilde; nh ngi i din t&igrave;m n ng kim v&ocirc; ch La Liga. Sau &oacute;, Ban l&atilde;nh o Barca &atilde; li&ecirc;n h vi thng tng MU v&agrave; nhn c c&acirc;u tr li t CEO&nbsp;Ed Woodward. Theo &oacute;,<strong>&nbsp;&ocirc;ng cho bit Pogba l&agrave; &#39;&#39;con cng&#39;&#39; ch i nh&agrave;, gia &igrave;nh&nbsp;Glazer.</strong>&nbsp;Messi quan trng vi g&atilde; khng l th n&agrave;o th&igrave; tuyn th s 6 quan trng vi &quot;Qu &quot; nh th &oacute;. V&agrave; tc nhi&ecirc;n, h s kh&ocirc;ng bao gi  anh ra i.&nbsp;</p>\r\n\r\n<p>Bch Bng | 15:34 03/01/2019</p>\r\n', 'YTBNC1CN', 0),
(42, 'duccong', , 'Lukaku b ch trch khng ht lng v Man Utd', 'Cu tin o tuyn Anh, Danny Murphy  ln ting ch trch Romelu Lukaku khi tin o ch lc ca Man Utd t chi ra sn t u trong trn chung kt FA Cup vi Chelsea.', '<p>Lukaku d&iacute;nh chn thng mt c&aacute; nh&acirc;n trong trn u vi Arsenal cui th&aacute;ng T. T &oacute; n trc trn chung kt&nbsp;<a href=\"http://www.bongda.com.vn/cup-fa/\" target=\"_blank\">FA Cup</a>, tin o ngi B kh&ocirc;ng ra s&acirc;n mt ph&uacute;t n&agrave;o. V&agrave; n trn chung kt, Lukaku ch v&agrave;o s&acirc;n t gh d b.</p>\r\n\r\n<p>Kh&ocirc;ng Lukaku, Man Utd thi u rt b tc vi Marcus Rashford tr&ecirc;n h&agrave;ng c&ocirc;ng. Vic thiu i ch&acirc;n s&uacute;t ch lc ca i b&oacute;ng l&agrave; mt trong nhng l&iacute; do khin Qu  phi ngm ng&ugrave;i nh&igrave;n Chelsea n&acirc;ng cao c&uacute;p v&ocirc; ch.</p>\r\n\r\n<p><img alt=\"Lukaku b ch trch khng ht lng v Man Utd - Bng \" src=\"http://media.bongda.com.vn/files/thach.pham/2018/05/22/c262896afe1e4bf08e82ab8992b0a1f3ashx-1715.jpg\" width=\"1024\" /></p>\r\n\r\n<h2>&nbsp;Lukaku b ch tr&iacute;ch khi t chi &aacute; ch&iacute;nh trc Chelsea.</h2>\r\n\r\n<p>Sau trn u, HLV Jose Mourinho tha nhn&nbsp;<a href=\"http://www.bongda.com.vn/thua-chung-ket-fa-cup-mourinho-to-lukaku-va-fellaini-choi-khong-het-suc-d446336.html\" target=\"_blank\">Lukaku &atilde; y&ecirc;u cu kh&ocirc;ng ra s&acirc;n &aacute; ch&iacute;nh v&igrave; l&iacute; do th lc</a>. V&agrave; Danny Murphy &atilde; l&ecirc;n ting ch tr&iacute;ch ng&ocirc;i sao tuyn B:&nbsp;<em>&quot;T&ocirc;i &atilde; gp  loi chn thng. V&agrave; t&ocirc;i cha bao gi t chi ra s&acirc;n c, tr khi th lc ca t&ocirc;i kh&ocirc;ng cho ph&eacute;p.</em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/thua-chung-ket-fa-cup-mourinho-to-lukaku-va-fellaini-choi-khong-het-suc-d446336.html\">Thua chung kt FA Cup, Mourinho t Lukaku v&agrave; Fellaini chi kh&ocirc;ng ht sc</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/mourinho-noi-gi-khi-de-lukaku-ngoi-du-bi-va-trang-tay-d446157.html\">Mourinho n&oacute;i g&igrave; khi  Lukaku ngi d b v&agrave; trng tay?</a></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p><em>C&oacute; mt v&agrave;i cu th li kh&ocirc;ng mun ra s&acirc;n d&ugrave; t 100% th lc. Nu &acirc;y l&agrave; s tht th&igrave;&nbsp;<strong>ngi h&acirc;m m Man Utd phi ph&aacute;t i&ecirc;n l&ecirc;n mt.</strong>&nbsp;Nu Romelu Lukaku cm thy m&igrave;nh s phi i mt vi iu g&igrave; &oacute; ti t, th&igrave; tt nht cu y ng ngi l&ecirc;n gh d b l&agrave;m g&igrave;.&quot;</em></p>\r\n\r\n<p>M&ugrave;a n&agrave;y, Lukaku &atilde; c&oacute; 27 b&agrave;n thng cho Man Utd. Anh s c&ugrave;ng TQG B chinh phc World Cup 2018 t ng&agrave;y 14/6. Nhiu ngi cho rng &acirc;y l&agrave; l&iacute; do khin Lukaku mun dng sc nhm tr&aacute;nh nhng ri ro  c&oacute; s chun b tt nht cho ng&agrave;y hi b&oacute;ng &aacute; ln nht h&agrave;nh tinh.</p>\r\n\r\n<p><strong>Tm quan trng ca Lukaku vi Man Utd:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Minh Tun | 16:27 22/05/2018</p>\r\n', 'PhapYTBNC1CN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(43, 'lelan7', , 'Xong! AC Milan chnh thc lm r kh nng Wenger thay Gattuso', 'Gim c th thao Leonardo cui cng  ln ting v bin ng trn bng gh ch o Rossoneri.', '<p>Th&aacute;ng 12 &atilde; tri qua kh&ocirc;ng th ti t hn vi AC Milan. 4 trn u Serie A gn nht,&nbsp;<a href=\"http://www.bongda.com.vn/ac+milan-search/\" target=\"_blank\">Rossoneri</a>&nbsp;kh&ocirc;ng ghi c bt k b&agrave;n thng n&agrave;o v&agrave; ri xung v tr&iacute; th 6 tr&ecirc;n BXH. Kh&ocirc;ng nhng th, tht bi 1-3 trc&nbsp;Olympiakos Piraeus c&ograve;n khin i ch s&acirc;n San Siro phi sm dng bc  Europa League ngay t v&ograve;ng bng.&nbsp;</p>\r\n\r\n<p>Phong  thm hi tr&ecirc;n khin chic gh ca&nbsp;Gennaro Gattuso lung lay d di.&nbsp;<a href=\"http://www.bongda.com.vn/sau-tat-ca-cdv-arsenal-van-rat-nang-long-voi-wenger-d477986.html\" target=\"_blank\">Cu thuyn trng Arsenal, Arsene Wenger</a>&nbsp;l&agrave; c&aacute;i t&ecirc;n c n o&aacute;n s sm thay th v tr&iacute; ca Gattuso ti AC Milan. Tuy nhi&ecirc;n, trong din bin mi nht, Rossoneri &atilde; b&aacute;c b th&ocirc;ng tin n&agrave;y.</p>\r\n\r\n<p><img alt=\"AC Milan lm r kh nng Wenger thay Gattuso - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/214238378-bf994080-824c-44d0-b145-92161124366b-0826.jpg\" width=\"560\" /></p>\r\n\r\n<h2>&nbsp;Gattuso s kh&ocirc;ng b thay th bi Wenger.</h2>\r\n\r\n<p>Ph&aacute;t biu vi ESPN, Gi&aacute;m c th thao&nbsp;Leonardo Araujo khng nh AC Milan vn t nim tin ln  HLV ng nhim.&nbsp;<em>&quot;<strong>Gattuso l&agrave; HLV ca ch&uacute;ng t&ocirc;i v&agrave; cha tng c&oacute; bt k k hoch thay th n&agrave;o.</strong>&quot;</em>&nbsp;Cu danh th Brazil qu quyt.&nbsp;<em>&quot;Ch&uacute;ng t&ocirc;i cha tng li&ecirc;n lc vi HLV n&agrave;o m&agrave; b&aacute;o ch&iacute; n thi thi gian qua. AC Milan vn ang tr&ecirc;n ng nhm n mc ti&ecirc;u ca m&igrave;nh, m&agrave; c th l&agrave; v tr&iacute; th 4 Serie A.&quot;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trc &oacute;&nbsp;<a href=\"http://www.bongda.com.vn/gennaro+gattuso%20-search/\" target=\"_blank\">Gattuso</a>&nbsp;cng tng ph&aacute;t biu t tin &ocirc;ng thng xuy&ecirc;n trao i vi gi&aacute;m c&nbsp;Paolo Maldini c&ugrave;ng Leonardo h&agrave;ng ng&agrave;y v&agrave; c bo m chc chn v tng lai.</p>\r\n\r\n<p>Phng S | 07:10 29/12/2018</p>\r\n', 'YTBNC1CN', 0);
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(1, 'hoduc17', , 'Xong! PSG chnh thc ra thng bo v vic bn Neymar v Mbappe', 'G nh giu nc Php ln ting v thng tin sp  2 siu sao ln ra i.', '<p>H&ocirc;m qua, n phm ni ting nc Ph&aacute;p, L&#39;Equipe &atilde; a ra th&ocirc;ng tin chn ng rng&nbsp;Paris Saint-Germain c&oacute; th phi b&aacute;n 1 trong 2 si&ecirc;u sao Neymar hoc Kylian Mbappe. T b&aacute;o n&agrave;y cho rng&nbsp;<a href=\"http://www.bongda.com.vn/duoc-moi-goi-sang-premier-league-day-la-cau-tra-loi-cua-neymar-d475888.html\" target=\"_blank\">ng kim v&ocirc; ch Ligue 1 buc c&acirc;n nhc c&aacute;c gii ph&aacute;p</a>,  c&oacute; th m bo Lut C&ocirc;ng bng t&agrave;i ch&iacute;nh FFP ca UEFA.</p>\r\n\r\n<p>Tin tc tr&ecirc;n g&acirc;y x&ocirc;n xao d lun v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/paris+saint+germain-search/\" target=\"_blank\">PSG</a>&nbsp;kh&ocirc;ng c&ograve;n c&aacute;ch n&agrave;o kh&aacute;c ngo&agrave;i l&ecirc;n ting. Trong th&ocirc;ng b&aacute;o c a ra ngay sau &oacute;, BL i ch s&acirc;n Parc des Princes &atilde; phn b&aacute;c ho&agrave;n to&agrave;n v&agrave; ch tr&iacute;ch ni dung b&agrave;i vit&nbsp;L&#39;Equipe ng ti.</p>\r\n\r\n<p><img alt=\"PSG ph nhn vic bn Neymar v Mbappe - Bng \" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/08/psg-lao-dao-vi-uefa-lai-so-gay-se-phai-ban-neymar-mbappe-cho-real-lopetegui-kembali-bantah-kaitan-real-madrid-dengan-1537851592-125-width660height495-1541.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;PSG kh&ocirc;ng c&oacute; &yacute; nh b&aacute;n b &ocirc;i si&ecirc;u sao.</h2>\r\n\r\n<p><em>&quot;<strong>CLB ph nhn tt c nhng c&aacute;o buc ho&agrave;n to&agrave;n sai lch&nbsp;v&agrave; k l</strong>, vi mc &iacute;ch duy nht  to ra bu kh&ocirc;ng kh&iacute; &aacute;p lc ln &egrave; l&ecirc;n i b&oacute;ng.&quot;</em>Trang ch PSG th&ocirc;ng b&aacute;o.&nbsp;<em>&quot;PSG th&ecirc;m mt ln ho&agrave;i nghi t&iacute;nh ch&acirc;n thc ca&nbsp;L&#39;Equipe v&agrave; ng c ng sau h&agrave;nh ng ca h.&quot;</em></p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/neymar-search/\" target=\"_blank\">Neymar</a>&nbsp;gia nhp i din th &ocirc; nc Ph&aacute;p trong thng v k lc chuyn nhng th gii tr gi&aacute; 200 triu bng t Barcelona nm ngo&aacute;i. Trong khi &oacute;, Mbappe cng tr th&agrave;nh cu th t gi&aacute; th hai mi thi i, sau khi PSG chp nhn chi 166 triu bng  s hu anh t AS Monaco.</p>\r\n', 'Phap');
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(4, 'lelan7', , 'Nng! Arsenal chun b \"cum\" ng i Messi, gi 40 triu bng\r\n', 'i ch sn Emirates ang chun b k hoch chiu m cu th chy cnh Cristian Pavon, ngi ang khoc o CLB Boca Juniors, theo The Sun', '<p>Arsenal ang rt n&oacute;ng l&ograve;ng a v mt tin o v&agrave;o th&aacute;ng Gi&ecirc;ng v&agrave;&nbsp;<strong>h c cho l&agrave; &atilde; m c&aacute;c cuc &agrave;m ph&aacute;n vi Boca Juniors - i b&oacute;ng s hu ch&acirc;n s&uacute;t Cristian Pavon</strong>. Cu th n&agrave;y ang gp kh&oacute; khn v&igrave; chn thng nhng Unai Emery rt y&ecirc;u th&iacute;ch phong c&aacute;ch ca tuyn th Argentina.</p>\r\n\r\n<p>T The Sun  Anh tuy&ecirc;n b rng Boca ang mong i mt li  ngh t The Gunners khi h mun thng v n&agrave;y s c quyt nh vi con s 40 triu bng. C&aacute;c i din ca&nbsp;<a href=\"http://www.bongda.com.vn/Pavon-search/\" target=\"_blank\">Pavon</a>&nbsp;cng li&ecirc;n lc vi mt s CLB v&agrave; h tin tng anh mun chuyn n Premier League.</p>\r\n\r\n<p><img alt=\"Nng! Duyt chi 40 triu bng, Arsenal chun b \" src=\"http://media.bongda.com.vn/files/toan.vu/2018/12/16/gettyimages-1045759054-1431.jpg\" width=\"644\" /></p>\r\n\r\n<h2>&nbsp;Pavon s gia nhp Arsenal v&agrave;o th&aacute;ng Gi&ecirc;ng?.</h2>\r\n\r\n<p>Fulham l&agrave; mt i din kh&aacute;c  x sng m&ugrave; tip cn ng i ca Lionel Messi tr&ecirc;n tuyn Argentina, nhng h buc phi ch&agrave;o thua v&igrave; mc ph&iacute; chuyn nhng vt qu&aacute; tm vi, trong khi Boca kh&ocirc;ng c&oacute; &yacute; nh h s tin nh d nh ban u.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, i b&oacute;ng va tht bi  CK Copa America trc River Plate tin rng 40 triu bng l&agrave; iu &quot;b&igrave;nh thng&quot; vi mt&nbsp;<a href=\"http://www.bongda.com.vn/Arsenal-search/\" target=\"_blank\">Arsenal</a>&nbsp;ang trong thi k chuyn giao quyn lc. H thc t phi ngh n phng &aacute;n thay Danny Welbeck v&igrave; tin o 28 tui &atilde; d&iacute;nh chn thng nng c&aacute;ch &acirc;y cha l&acirc;u.</p>\r\n\r\n<p>Cha k, Aaron Ramsey cng chc chn ra i v&agrave;o cui m&ugrave;a gii hoc c&oacute; th l&agrave; ngay th&aacute;ng sau nu i b&oacute;ng n&agrave;o &oacute; ngo&agrave;i bi&ecirc;n gii nc Anh bo chi. &oacute; l&agrave; l&yacute; do Pavon l&agrave; s la chn l&yacute; tng v&agrave;o thi im n&agrave;y v&igrave; 40 triu bng b&acirc;y gi kh&ocirc;ng thm th&aacute;p v&agrave;o &acirc;u nu nh&igrave;n v&agrave;o s lng on ca TTCN.</p>\r\n', 'DucYCN');
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(5, 'lelan7', , 'Gn gi ra qun, dn sao Liver nghim tc n l', ' Liverpool tch cc tp luyn cho trn i chin vi Man City.', '<p><img alt=\"Liver tp - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Rng s&aacute;ng 3/1, Liverpool s h&agrave;nh qu&acirc;n n s&acirc;n Etihad i u vi Man City.</h2>\r\n\r\n<p><img alt=\"Liver tp - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt1-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Liverpool ang ra sc tp luyn cho trn i chin quyt nh.</h2>\r\n\r\n<p><img alt=\"Liver tp - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt2-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Tt c u ch&uacute; t&acirc;m tp luyn.</h2>\r\n\r\n<p><img alt=\"Liver tp - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt3-1040.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Ch cn gi&agrave;nh chin thng, The Kop c&oacute; quyn ngh v chc v&ocirc; ch cui m&ugrave;a.</h2>\r\n\r\n<p><img alt=\"Liver tp - Bng \" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt4-1040.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Hin ti, Liver c &aacute;nh gi&aacute; nhnh hn Man City.</h2>\r\n', 'Anh');
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(6, 'hoduc17', , 'grgrg', 'gdfgdgdfgdgdgfgg', '<p>tyhtryetytrhgffhgfhd</p>\r\n', 'DucY');
